INSERT INTO `gd8h_bb_matches` (`match_id`, `round`, `f_tour_id`, `challenge`, `submitter_id`, `stadium`, `gate`, `ffactor1`, `ffactor2`, `fame1`, `fame2`, `income1`, `income2`, `team1_id`, `team2_id`, `date_created`, `date_played`, `date_modified`, `team1_score`, `team2_score`, `comment`, `c_rating_1`, `c_rating_2`, `c_rat_change`, `TV1`, `TV2`) VALUES
(23, NULL, 1, 0, 131, NULL, 27000, -1, 1, 0, 1, 40, 60, 37, 40, '2008-02-06 19:02:01', '2008-02-06 00:00:00', '2008-02-06 19:02:01', 0, 4, '<div align="left">Kasper var ikke d&aring;rlig, men ingen kan k&aelig;mpe mod Nuffle.. Steen rullede de vilde armour roll. det resulterede i 1 BH 4 SI 0 DEAD. Derudover var der 2 KO. Kasper pr&oslash;vede sig med 1 enkelt foul og det resulterede i han blev smidt ud uden at g&aring; igennem armour. Kasper startede 2. halvleg med kun 6 spillere hvor den ene fik en klippe i hovedet, og resten af halvlegen var der mellem 3-5 af kaspers folk p&aring; banen. Oven i alt dette fik Steen et Blitz! ved 2-0 midt i 2. halvleg. Alt i alt s&aring; var kampen meget uretf&aelig;rdig med at Steen var MEGA heldig hele kampen igennem, og kasper var t&aelig;t p&aring; chancel&oslash;s.</div>', 1200, 1214, -25, 0, 0),
(22, NULL, 1, 0, 63, NULL, 17000, 1, 0, 0, 1, 20, 40, 39, 38, '2008-02-05 00:00:00', '2008-02-05 00:00:00', '2008-02-06 17:02:40', 2, 1, '<p>Lorte Terninger !!!</p>', 1186, 1200, 17, 0, 0),
(20, NULL, 1, 0, 63, NULL, 17000, 1, 0, 1, 0, 80, 60, 40, 39, '2008-02-04 17:02:32', '2008-02-04 00:00:00', '2008-02-16 11:02:15', 2, 1, '', 1200, 1200, 14, 0, 0),
(19, NULL, 1, 0, 63, NULL, 14000, 0, 1, 2, 0, 70, 30, 27, 35, '2008-02-06 17:02:31', '2008-02-03 00:00:00', '2008-02-06 17:02:31', 2, 3, '<p>Andre''s Skaven k&aelig;mpede bravt og sp&aelig;ndingen var intakt i tur 8 af anden halvleg da der blev rullet en riot ved stillingen 3-2 og Andr&eacute; pludselig fik 2 ture til at score i. Det skulle dog ikke v&aelig;re.</p>', 1200, 1200, -17, 0, 0),
(25, NULL, 1, 0, 63, NULL, 26000, 1, 0, 1, 1, 30, 40, 43, 39, '2008-02-11 21:02:17', '2008-02-11 00:00:00', '2008-02-16 11:02:37', 3, 1, '<div align="left">\r\n<p>Det var en h&aring;rd kamp fra starten af hvor skinks''ne kiksede grusomt og woodelverne misbrugte p&aring; det groveste. Efter at have tiltusket sig det f&oslash;rste m&aring;l i runde 2 eller 3 fik elverne en hj&aelig;lpende h&aring;nd fra publikum ved at lave en Pitch Invasion og l&aelig;gge halvdelen af &oslash;glerne ned mens kun en enkelt elver lod sig fange.</p>\r\n<p>Efter et s&aring;danne et overfald var det en smal sag for de hoppende elvere at komme over det bjerg af &oslash;glek&oslash;d, der l&aring; og fl&oslash;d for at skaffe sig adgang til bolden og lave endnu et m&aring;l inden halvlegen blev fl&oslash;jtet af.</p>\r\n<p>Det m&aring; da lige n&aelig;vnes at &Oslash;glerne slog fra sig i frustration over at elverne blev ved med at snuppe bolden foran n&aelig;pet p&aring; dem, men eftersom publikum ikke er til stede for at se blod, men suver&aelig;n boldspil er det n&aelig;sten ikke linierne v&aelig;rd at n&aelig;vne dette faktum.</p>\r\n<p>I anden halvleg var det elverne der fik lov til at f&aring; bolden serveret og det starter da meget fint med at den ender lige et felt fra midterlinien og elvernes thrower Viscum, har overblikket til at stille sig under bolden (takket v&aelig;re High Kick), men han f&aring;r tydeligvis solen i &oslash;jnene eftersom han ikke griber den og bolden rammer en kocentreret lineelf lige i nakken og ender af uforklarlige grunde i h&aelig;nderne p&aring; &oslash;glernes stupide k&oslash;dhakker, Kroxigoren Nakai hvilket overresker alle....... de smidige, men muskelmanglende elvere kan kun se p&aring; mens tomhjernen lunter mod elvernes m&aring;llinie (godt hjulpet af de n&aelig;sten lige s&aring; dumme Sauruser), men LO om der ikke er nogle svagelige Skinks til stede man kunne tampe p&aring;!!! Desv&aelig;rre lod det til at elverne var for frustrerede over at de ikke havde bolden til at g&oslash;re andet end at tjatte til mini sauruserne.... (er der forresten nogen der ved om Skinks bliver til Sauruser n&aring;r de bliver voksne??!!)</p>\r\n<p>Tilbage til boldtspillet....efter at Kroxigoren endeligt f&aring;r taget sig sammen og luntet over m&aring;llinien kan elverne endeligt komme tilbage til noget proffessionelt kvalitets boldtspil...</p>\r\n<p>Efter at &Oslash;glefansene lige havde vist hvad de mente om deres hold med en flyvende sten, havde de sm&aring; skinks gang i bolden til den store guldmedalje. Mens elverne og Saurusarne tampede l&oslash;s p&aring; hinanden uden at finde en desideret overmand, var de sm&aring;, irriterende mider n&aring;et godt op over elvernes banehalvdel og havde gjort sig klar til at udligne til 2-2.</p>\r\n<p>Efter at have d&aelig;kket elverne op efter bedste evne og de to Wardancere Salix og Adonis stod og havde en fangelegs konkurrance p&aring; &oslash;glernes halvdel (guderne m&aring; vide hvad de lavede der mens bolden var i modsatte ende af banen), s&aring; det stod til elvernes Thrower Viscum at pande skinken Zlat...&aelig;hhh.... en af skinksne ned (de ligner alle hinanden, hvem kan holde styr p&aring; de fiske hoveder), hvilket han gjorde efter en beh&aelig;ndig dodgning og s&aring; var der Lineelveren Heracleum, som lavede en perfekt aflevering til Salix, der  smuttede fra en langsommelig Saurus og i ro og mag skorede m&aring;l nr 3 for THE TREE HUGGER CRUSADERS!!!</p>\r\n<p>I kampens sidste runde h&aelig;vnede &oslash;glerne sig ved at gennemprygle de tapre tre elvere, der stillede sig heltemodigt i vejen for de barbariske horder, der var Lizaedmen.... det kr&aelig;vede endnu et elveroffer, men heldigvis n&aring;ede apotekeren frem i tide og kunne redde nr 10 Pronus fra den vise d&oslash;d.</p>\r\n<p>En velfortjent 3-1 sejer til THE TREE HUGGER CRUSADERS efter at have p&aring;draget sig 4  casulties og deriblandt et mord!!!</p>\r\n<p>herfra siger den totalt upartiske og retf&aelig;rdig komentator Durkan MILFlover farvel og tak efter denne sindsoprivende kamp og lover at holde n&oslash;je &oslash;je med dette nye, sp&aelig;ndede og forbedre hold THE TREE HUGGER CRUSADERS!!!..... og selvf&oslash;lgelig l&aelig;kre damer p&aring; 35+..... indtil n&aelig;ste THE TREE HUGGER CRUSADERS kamp!!!!</p>\r\n</div>', 1200, 1222, 24, 0, 0),
(26, NULL, 1, 0, 63, NULL, 21000, 0, 1, 0, 2, 30, 60, 34, 39, '2008-02-09 01:02:36', '2008-02-09 00:00:00', '2008-02-09 08:02:03', 0, 2, '', 1200, 1203, -19, 0, 0),
