(28, NULL, 1, 0, 63, NULL, 20000, 1, 1, 0, 0, 20, 50, 43, 39, '2008-02-13 21:02:18', '2008-02-13 00:00:00', '2008-02-16 11:02:46', 2, 2, '', 1224, 1198, -1, 0, 0),
(29, NULL, 1, 0, 91, NULL, 24000, 1, -1, 0, 1, 70, 60, 43, 40, '2008-02-18 19:31:46', '2008-02-18 00:00:00', '2008-02-21 00:42:26', 2, 1, '<p class="blog">&nbsp;</p>\r\n<p class="content">&nbsp;</p>\r\n<p align="left"><font size="2" face="Times New Roman ">Uh ha folkens det var en sp&aelig;ndende kamp lige til sidste runde!!!!!</font></p>\r\n<p align="left"><font size="2" face="Times New Roman "> Der var masser af blod og knubs til de brave elvere som s&aelig;dvanligt og selvf&oslash;lgeligt skulle orkerne dr&aelig;be en uforskyldt rookie.<br />\r\n</font><font size="2" face="Times New Roman ">Man s&aring; de dexteri&oslash;se elvere levere et fantastisk boldt spil og publikum gik helt amok med jubel og slagord. De kastede med sten efter spillerne og flasker efter dommeren og boldten over hele banen efter at den r&oslash;g ud til dem.</font></p>\r\n<p align="left"><font size="2" face="Times New Roman ">Det f&oslash;rste m&aring;l blev overreskende nok og hvis jeg selv skal sige det ufortjent skoret af John efter at voldeligt at fravriste bolden fra superspillerne THE TREE HUGGER CRUSADERS. Men de fantastiske Crusaders kom godt igen og skorede blot to runder efter til 1-1.</font></p>\r\n<p align="left"><font size="2" face="Times New Roman ">I anden halvleg var der en masse tumlen rundt og fumlen med bolden, da den praktisk taget var smurt ind i elverblod (man kan n&aelig;sten fristes til at sige som s&aelig;dvanligt desv&aelig;rre!!) og til sidst fik Crusader throweren Viscum nok og sendte en af orkerne ud i omkl&aelig;dningsrummet med en gevaldig blodtud efterfuldt af et mesterv&aelig;rk af boldtspil der fik </font><font size="2" face="Times New Roman ">THE TREE HUGGER CRUSADERS ind p&aring; f&oslash;repositionen.</font></p>\r\n<p align="left"><font size="2" face="Times New Roman ">Det m&aring; dog n&aelig;vnes at orkerne gjorde deres for at f&aring; udlignet men </font><font size="2" face="Times New Roman ">THE TREE HUGGER CRUSADERS holdt dem hend med store personlige ofre!!!</font></p>\r\n<p align="left"><font size="2" face="Times New Roman ">kampen s</font><font size="2" face="Times New Roman ">luttede 2-1 hvor orkerne var meget t&aelig;t p&aring; at f&aring; udlignet i sidste tur, men lad os v&aelig;re &aelig;rlige, orker er ikke fingerf&aelig;rdige nok til at spille boldtspillet som elverne er.....</font></p>\r\n<p align="left">&nbsp;</p>\r\n<p align="left"><font size="2" face="Times New Roman ">Med disse ord vil jeres upartiske kommentator </font><font size="2" face="Times New Roman ">Durkan MILFlover sige farvel og tak for endnu en fantastisk kamp med de framragende </font><font size="2" face="Times New Roman ">THE TREE HUGGER CRUSADERS som de naturlige vindere af endnu en blodig kamp!!!!</font></p>\r\n<p align="left"><font size="2" face="Times New Roman ">Til vi ses igen ved den n&aelig;ste </font><font size="2" face="Times New Roman ">THE TREE HUGGER CRUSADERS kamp mod overmagten kom og se og tag jeres modne k&aelig;rester eller m&oslash;dre med s&aring; vi ogs&aring; har noget godt at se p&aring; i pauserne.</font></p>\r\n<p align="left"><font size="2" face="Times New Roman ">Farvel og tak for denne kamp!!!!</font></p>\r\n<p align="left">&nbsp;</p>\r\n<p>&nbsp;</p>', 1223, 1261, 18, 0, 0),
(30, NULL, 1, 0, 65, NULL, 21000, 1, 0, 2, 0, 80, 20, 27, 34, '2008-02-17 17:38:51', '2008-02-17 00:00:00', '2008-02-17 17:38:51', 4, 0, '', 1183, 1181, 24, 0, 0),
(31, NULL, 1, 0, 63, NULL, 19000, 1, 1, 0, 1, 90, 30, 35, 50, '2008-02-17 22:12:55', '2008-02-17 00:00:00', '2008-02-18 10:19:48', 2, 2, '<p>Rasmus'' f&oslash;rste rating kamp startede fint med 2-0 i f&oslash;rste halvleg. De ud&oslash;de var h&aring;rdt pressede og m&aring;tte tage handskerne af i anden halvleg (hjulpet af et get-the-ref rul!). Efter tur 11 var stillingen 2-1 og elverne kunne stille 5 mand p&aring; banen! tur 14 gav udligningen og i tur 16 skilte &eacute;t 3+ slag de ud&oslash;de fra sejren. (Lybaras winnings inkluderer 40K for en zombie der genopstod fra det andet hold)</p>', 1217, 1200, 0, 0, 0),
(32, NULL, 1, 0, 63, NULL, 22000, 1, 0, 0, 1, 40, 30, 35, 39, '2008-02-18 21:38:44', '2008-02-18 00:00:00', '2008-02-21 20:50:31', 2, 1, '<p>Undskyld Niels!</p>\r\n<p>Det opsummerer ganske godt anden halvleg. &Oslash;glerne kom foran 1-0 i f&oslash;rste halvleg efter d&aring;rligt spil af de ud&oslash;de. Anden halvleg skulle v&aelig;re helt anderledes. <u>Inden</u> 3L''s tur 9 have de allerede bolden pga. et blitz kick-off. 4 ture senere blev der endelig udlignet. I mellemtiden fl&oslash;j der skinks ud af banen konstant. Specielt deres dodges var d&oslash;delige og 1 skink m&aring;tte lade livet. Sammenlagt var der 13 spillere p&aring; banen lige inden m&aring;let til 1-1.</p>\r\n<p>Den sidste skink r&oslash;g ud lige efter kickoff og dermed havde &oslash;glerne ingen med Ag over 1. Samtidig var de ud&oslash;de kommet talst&aelig;rkt tilbage p&aring; banen og spillede 11 mod 6. Alligevel skulle der en dramatisk slutning til for at sikre sejren. En serie best&aring;ende af Dodge-dodge-GFI-pass-catch (5+,4+,2+,4+,3+) uden rerolls reddede sejren til 3L! Det var der mindre end 5% chance for ville lykkes!</p>', 1217, 1199, 15, 0, 0),
(33, NULL, 1, 0, 65, NULL, 29000, 1, 0, 1, 0, 70, 20, 27, 40, '2008-02-23 22:00:04', '2008-02-23 00:00:00', '2008-02-23 22:00:04', 2, 1, '', 1207, 1266, 16, 0, 0),
(34, NULL, 1, 0, 63, NULL, 17000, 1, 0, 1, 0, 60, 60, 39, 43, '2008-02-21 20:43:10', '2008-02-21 00:00:00', '2008-02-25 10:50:25', 2, 1, '<div align="left">\r\n<p><font size="2"><font face="Times New Roman ">Velkommen &aelig;rede publikum til endnu en fantastisk Bloodbowl kamp mellem TH Crusaders og 2L (ikke at forveksle med Undead holdet 3L, som TH Crusades skal spille mod i n&aelig;ste uge) p&aring; denne, en VIRKELIG solskindet dag, men det bringer blot bekinierne frem p&aring; de framragende damer der ligeledes er med..... &aelig;hm m&aring;ske ikke lige p&aring; hende orkmatronen p&aring; sektion C, r&aelig;kke 16 stol.... 10 tror jeg det er.....jeg troede at damer havde aftaler med deres kl&aelig;deskab om hvad de skulle holde sig fra for ikke at g&oslash;re andre blinde!!!!!!!!!</font></font></p>\r\n<p><font size="2"><font face="Times New Roman ">N&aring;, men tilbage til kampen!! </font></font></p>\r\n<p><font size="2"><font face="Times New Roman ">Som sagt er solen virkelig fremme her idag og det g&oslash;r jo at spillerne kan f&aring; solstik og det p&aring;virker jo &oslash;glernes spillef&aelig;rdigheder, mens Crusaders selvf&oslash;lgeligt er for professionelle til at det vil p&aring;virke deres spil overhovedet, det ved vi jo alle!!!!</font></font></p>\r\n<p><font size="2"><font face="Times New Roman ">Det er &oslash;glerne der starter....h&oslash;r har de ikke lige lovligt mange firben med, &oslash;h.... skinks hedder de selvf&oslash;lgeligt og de ser ud til at v&aelig;re plukket lige fra publikum. </font></font></p>\r\n<p><font size="2"><font face="Times New Roman ">N&aring; hvad, det vil selvf&oslash;lgeligt ikke have nogen effekt p&aring; Crusaderne. Som jeg, jeres kommentator Durkan MILFLover, var ved at sige var at det er &oslash;glerne, der starter med at angribe og bolden placeres som s&aelig;dvanligt mesterligt af Crusader kickeren nr. 5 Isatis, og &oslash;glerne m&aring; bev&aelig;ge sig lanngt for at f&aring; fingre i bolden, hov de lader til at starte spillet med at sl&aring; l&oslash;s p&aring; de tre Journeymen, der har f&aring;et &aelig;ren af at spille med som prospects og.... ej nu m&aring; de sk&aelig;llede husdyr da styre sig....der r&oslash;g den f&oslash;rste af </font></font><font size="2"><font face="Times New Roman ">prospect''ne og ja det ser ud til at han m&aring;tte lade livet for spillet, sikke en m&aring;de at d&oslash; p&aring;, jeg er sikker p&aring; at han vil blive husket som de andre wannabe spillere, jeg ved i hvert fald at hans navn kommer til at blive kunstf&aelig;rdigt formet ind i TH Crusader mindetr&aelig;et, sammen med de tre andre der allerede er d&oslash;de i denne s&aelig;sson. </font></font></p>\r\n<p><font size="2"><font face="Times New Roman ">N&aring;, men the game must go on og bolden er i spil og de forvoksede firben har fat i bolden dybt i deres forsvar og ser ud til at ville hugge bolden, men se nu her!!!! Alle kvindernes Guddommelige idol, Salix (self&oslash;lgeligt, jeg er jo ikke p&aring; banen, he he), wardanceren bryder igennem 2L''s forsvar og kommer n&aelig;sten frem til mini sauruserne inden de f&aring;r set sig om og minsanten om deres drive bliver brudt og Adomis ender med at skore i runde 4.</font></font></p>\r\n<p><font size="2"><font face="Times New Roman ">TH Crusaderne stiller op til et st&aelig;rkt angreb som de er ber&oslash;mte og i visse kredse berygtede for, men hvad er det!!??? Et sabotage...ja....snarere et snigmord!!!! Salix er blevet ramt i baghovedet af et eller andet projectil og ligger helt stille p&aring; banen, sikke en katastrofe!!! her kommer holdets mirakelmager p&aring; sidelinien, Mirakularix (....og NEJ han er ikke besl&aelig;gtet med ham, den ubetydelige Galler) og han f&aring;r stablet Salix p&aring; benene igen og det ser ud til at han er klar til at komme p&aring; banen igen n&aring;r der kommer et m&aring;l.</font></font></p>\r\n<p><font size="2"><font face="Times New Roman ">TH Crusaderne m&aring; nu klare sig uden Salix, men da det ikke er et etelvershold, s&aring; er det ikke noget problem, da Adonis hopper over en kluntet Saurus og g&aring;r dybt i &oslash;glernes forsvar hvor han f&aring;r bolden og er langt fra enhver Saurus, men til geng&aelig;ld bliver han fuldst&aelig;ndigt omringet af firben, der lykkes at fravriste ham bolden ved simpelt hen at v&aelig;re i overtal. Der er da ogs&aring; gr&aelig;nser for hvor mange man kan undg&aring; inden man bliver trukket ned.</font></font></p>\r\n<p><font size="2"><font face="Times New Roman ">Som sagt har de sm&aring; satans firben f&aring;et fat i bolden og Kroxi er da endeligt v&aring;gnet op fra sin omt&aring;gede gr&aelig;sskyer og forts&aelig;tter med at pounde l&oslash;s p&aring; de brave Crusader, der p&aring; nuv&aelig;rende tidspunkt er i undertal med to elvere og holder stadig skansen mod de fysiskt st&aelig;rkere &oslash;gler. </font></font></p>\r\n<p><font size="2"><font face="Times New Roman ">Her i tur 8 har &oslash;glerne simpelthen banket sig vej til at st&aring; lige op og ned af de brave TH CRUSARES m&aring;l linie, men det lader til at firbenet med bolden er blevet s&aring; facineret af sine holdkammaraters voldsrus at den simpelthen er stoppet op for at betragte det blodige syn og selv dommeren syntes det er for meget og bl&aelig;ser af til halvleg inden firbenet er n&aring;et i m&aring;l og TH Crusade''s fans jubler ligesom jeg er sikker p&aring; at I g&oslash;r k&aelig;re lyttere!!! vi g&aring;r til halvleg med en naturlig og velfortjent f&oslash;reing til TH Crusaders p&aring; 1 - 0.</font></font></p>\r\n<p><font size="2"><font face="Times New Roman ">Anden halvleg skiller sig ikke meget ud fra den f&oslash;rste ud over at Kroxien er blevet mere effektiv i sin h&aelig;rgen af det brave TH Crusader forsvar, der bider smerten i sig og forts&aelig;tter til den bitre ende er jeg vis p&aring;.</font></font></p>\r\n<p><font size="2"><font face="Times New Roman ">Hvad er dette &oslash;glerne har brudt Crusadernes drive og det har rent faktisk lykkedes dem at skore i 5. runde her i anden halvleg!!!! TH Crusades m&aring; virkeligt v&aelig;re tr&aelig;ngt til det yderste, men de har gjort det godt indtil videre og jeg er sikker p&aring; at ingen flere m&aring;l vil blive lukket ind over deres m&aring;l linie.</font></font></p>\r\n<p><font size="2"><font face="Times New Roman ">et nyt drive bliver gjort klart og duoen Salix og Adonis g&oslash;r sig klar p&aring; deres faste pladser alt ser ud til at starte som det skal. Men hvad er nu det?? &oslash;glerne kan &aring;benbart ikke t&aring;le konstruktiv kritik af deres spillemetoder og alle hopper i totterne p&aring; hinanden, hold da op, det skal jo v&aelig;re en f&oslash;rste gang for alt.....apropo er det kun mig der har bem&aelig;rket hende den fyrrige 400 &aring;rige skovnymfe, der solbader p&aring; de &oslash;verste r&aelig;kker i sektion D og hun er ikke sky af sig..... hold da op.....det er vist ikke et tilf&aelig;lde hun befinder sig i den sektion.....det skulle helst passe med atributterne wouw!!!!<br />\r\n</font></font></p>\r\n<p><font size="2"><font face="Times New Roman ">Ahh.... det ser ud til at dommerne har f&aring;et skilt holdene ad og har endda sat uret tilbage til urolighedernes start. Crusaderne g&aring;r dybt i angrbet igen og &oslash;glerne kaster sig over dem som s&aelig;dvanligt, men hvad er nu dette.....auch, det lader til at Kroxien fanger Adonis mellem at han tr&aelig;der p&aring; et firben og at han vil tr&aelig;de tilbage og der kom en kl&oslash;r 5 lige i det smukke ansigt og Adonis er helt v&aelig;k....det ser ud til at vi ikke ser ham i aktion f&oslash;r han er kommet ud af dette koma!!! SKANDALE, stupide &oslash;gler burde ikke blive lukket ind p&aring; banen!!! det burde forbydes. Et tydeligt sv&aelig;kket Crusader hold k&aelig;mper bravt videre men det ser sort ud da de nu er tre elvere i undertal og &oslash;glerne har bolden. Crusaders tr&aelig;kekr sig l&aelig;ngere tilbage p&aring; banen og pr&oslash;ver at omgruppere og der var et hul, men det lykkes kun at skubbe firbenet med bolden tilbage og ganske rigtigt de sm&aring; firben smutter fra de st&aelig;rkt pressede Crusaders og der er intet at g&oslash;re!!! Det er en sorgens dag!! &oslash;glerne skorer i tur 7, uden at skovelverne har en chance at n&aring; at udligne og m&aring; se i &oslash;jnene at dette er deres f&oslash;rste nederlag i denne sesson.</font></font></p>\r\n<p><font size="2"><font face="Times New Roman ">Selv vejrguderne m&aring; s&oslash;rge for solen skjuler sig bag skyerne og det m&aring; v&aelig;re blevet lidt mere udholdeligt at v&aelig;re p&aring; banen, men det er ligegyldig, ja n&aelig;rmest nyttel&oslash;st da spillet s&aring; godt som er slut, spillerne stiller op for sidste gang og afslutter med at komme af med nogle frustationer, men det ser ud til at alle er udmattede og ingen g&oslash;r en ekstra indsats for at f&aring; noget slagkr&aelig;ft igennem.</font></font></p>\r\n<p><font size="2"><font face="Times New Roman ">Kampen slutter med et fuldst&aelig;ndig ufortjent 2-1 sejer til &oslash;glerne efter at have tampet sig igennem hele spillet. Dette er jeres, som altid, upartiske kommentator Durkan MILFLover og h&aring;ber at et lidt mere bold orienteret spil vil blive spillet ved n&aelig;ste TH Crusader kamp mod orkerne &quot;In the name of John&quot;, men jeg tvivler, da orker ikke ligefrem der meget forskellige end &oslash;glerne hvis man ser p&aring; deres forrige m&oslash;de med TH Crusaders, men nu f&aring;r vi se.....</font></font></p>\r\n<p><font size="2"><font face="Times New Roman ">Husk lige at k&oslash;be det helt nye BLOODBOWL SPORTSBLAD - &quot;</font></font><font size="2"><font face="Times New Roman ">BLOODBOWL INSIDE</font></font><font size="2"><font face="Times New Roman ">&quot; med artikler som &quot;bloodweiser babes uncovered&quot; og ikke mindst et l&aelig;ngere interwiev mellem mig jeres yndlings kommentator og jeres idol Salix, hvor han fort&aelig;ller om hans vej til SUPER</font></font><font size="2"><font face="Times New Roman ">BLOODBOWL Ligues og f&aring; en foldud plakat med samme idol for kun 9,99 guld dubloner!!!! Et rent r&oslash;verk&oslash;b!!! (jeg f&aring;r n&aelig;sten ingen procenter per solgt blad s&aring; dette er kun en tjeneste til jer, forbrugere og fans at jeg lige n&aelig;vner dette)<br />\r\n</font></font></p>\r\n<p><font size="2"><font face="Times New Roman ">Farvel og tak herfra!!!</font></font></p>\r\n</div>', 1184, 1240, 16, 0, 0),
(35, NULL, 1, 0, 65, NULL, 25000, 1, -1, 0, 1, 40, 20, 53, 27, '2008-03-02 22:38:36', '2008-03-02 00:00:00', '2008-03-02 22:38:36', 2, 0, '', 1157, 1258, 30, 0, 0),
(36, NULL, 1, 0, 63, NULL, 22000, 1, 0, 1, 0, 30, 50, 35, 43, '2008-02-28 22:39:46', '2008-02-28 00:00:00', '2008-03-03 08:11:03', 4, 3, '<p>Det anede mig at den levende hund ''Durkan MILFLover'' ikke ville rapportere fra denne kamp som lovet. Egentlig er der ikke noget at sige til det for hans k&aelig;led&aelig;gger fik t&aelig;v! - Igen!</p>\r\n<p>N&aring; men jeg glemmer mine manerer. Lad mig pr&aelig;sentere mig selv: Folk kalder mig bedemanden. Lad mig straks sl&aring; fast at mit dagarbejde p&aring; ingen m&aring;de influerer min vurdering af dette fine spil. Dem der p&aring;st&aring;r jeg altid holder med t&aelig;ske holdene tager fuldst&aelig;ndig fejl.</p>\r\n<p>N&aring; - til kampen...</p>\r\n<p>22.000 tilskuere ser THC modtage bolden. K&aelig;kke som de er skal en wardancer straks leape over 3L''s forsvar - Fors&oslash;get fejler, wardanceren ender i knock-out boksen og straks er 3L i offensiven. I deres tur 2 st&aring;r det 1-0.</p>\r\n<p>Hermed var stemningen lagt og der scores yderligere 3 m&aring;l i f&oslash;rste halvleg til stillingen 2-2</p>\r\n<p>I anden halvleg kommer begge wardancere p&aring; banen igen, men imedens er der tyndet godt ud hos elverne. 3L udviser til geng&aelig;ld deres s&aelig;dvanlige styrke og har fortsat 11 p&aring; banen.</p>\r\n<p>3L''s drive f&oslash;rer til 3-2 og kort efter brydes elvernes drive og stillingen bliver 4-2. Samtidig skabes der arbejde til mig - hrmmm, jeg mener en uheldig elver m&aring; lade livet - stakkels elver <img alt="" src="/mambots/editors/fckeditor/editor/images/smiley/msn/cry_smile.gif" />. Efter en kort snak med 3L''s coach v&aelig;lger holder IKKE at genoplive elveren som zombie, da de har nok spillere.</p>\r\n<p>Som tr&oslash;st f&aring;r elverne scoret til 4-3 hvilket er kampens resultat. 3L er tilfredse og det er publikum ogs&aring;. 7 m&aring;l i samme kamp vidner om hurtigt og underholdende spil.</p>\r\n<p>&nbsp;</p>', 1233, 1201, 13, 0, 0),
(37, NULL, 1, 0, 63, NULL, 20000, 1, 0, 0, 1, 60, 60, 40, 43, '2008-02-22 16:41:07', '2008-02-22 00:00:00', '2008-02-25 19:02:44', 3, 1, '<p>Velkommen til &aelig;rede publikum, til en perfekt Bloodbowl dag med en kamp mellem superholdet TH Crusaders og orkerne &rdquo;In the name of John&rdquo;. Jeg er , som altid jeres upartiske kommentator, Durkan MILFLover.<br />\r\n<br />\r\nInden spillerne kommer p&aring; banen kan jeg med gl&aelig;de fort&aelig;lle alle dedikerede fans, b&aring;de her p&aring; stadionet, lytterne og ikke mindst, de personlige fans, der belejrer hospitalet, som Adonis ligger p&aring;. At han er kommet ud af det koma som Kroxien fra 2L tildelte ham, men han er f&oslash;rst klar til at spille med igen i n&aelig;ste uge n&aring;r kampen st&aring;r mod de ud&oslash;de 3L.<br />\r\n<br />\r\nSpillerne har stillet sig i formation og det er de fenominale Crusaders, der reciever. Det m&aring; dog lige n&aelig;vnes at pga sidste kamp var der s&aring; mange skader at Crusaders har hele 4 prospects p&aring; banen!!!<br />\r\n<br />\r\nBolden samles op og gives til holdets thrower Viscum, der tr&aelig;kker sig lidt tilbage p&aring; egen banehalvdel og bliver masivt beskyttet af resten af holdet, mens wardanceren Salix og lineelfen Fennikel tr&aelig;nger ind p&aring; orkernes h&oslash;jre flanke, hvor de har sl&aring;et sig igennem forsvaret.<br />\r\nOrkerne svarer igen ved at sv&aelig;rme dem der beskytter Viscum, samt de to angribere og de er specielt rundh&aring;ndede med de l&oslash;se knytn&aelig;ver til Salix og Fennikel. Det lykkedes da Salix at smutte fra forsvaret og komme ind i endzone hvor Viscum laver en Longbomb til ham, og se den perfekte bue bolden sv&aelig;ver i!!Der ser ud til at v&aelig;re m&aring;l her i fjerde runde, men hvad er nu det!! Salix er ved at gribe bolden, da der er hvad der ligner et spejlrefleks lige i ansigtet p&aring; ham og han har ikke nogen mulighed for at se bolden og misser den fuldst&aelig;ndigt!! KATASTROFE, den slags publikum burde skydes!!<br />\r\nMens Salix pr&oslash;ver at f&aring; solpl&aelig;tterne ud af &oslash;jnenen udnytter orkerne chancen til at skubbe ham ud til sit eget publikum, der sender knytn&aelig;ve efter knytn&aelig;ve efter den, for orkerne, forhadte wardancer, men han slipper heldigvis fra dem og n&aring;r frem til reserveboxen.<br />\r\n<br />\r\nOrkerne tager sig god tid til at komme op iden anden ende for at skore, selv om Crusaders g&oslash;r hvad de kan for at stoppe dem og tage bolden fra dem, lykkes det dem at lave et m&aring;l lige inden dommeren bl&aelig;ser til halvleg.<br />\r\nDet er skuffende, men desv&aelig;rre virkeligt. Vi g&aring;r til halvleg med et ufortjent 0-1 f&oslash;ring til orkerne.....<br />\r\n<br />\r\nVi starter 2. halvleg med orkerne, der reciever, men Crusaders f&aring;r lov til at omrokere til et perfect diffenc, men da de allerede har det forts&aelig;tter spillet. Orkerne banker sig vej gennem linie forsvaret med s&aelig;dvanlig brutalitet og l&oslash;ber....&oslash;hh lunter... straks videre til det sekund&aelig;re forsvar og pr&oslash;ver at blitze sig gennem, men kommer ikke videre i f&oslash;rste omgang. Det er f&oslash;rst da #10 Pronus pr&oslash;ver at komme ind til bolden efter at orkernes thrower blev blitzet, men lige f&oslash;r han for fat i bolden misser han sit dodge og forstuver anklen. <br />\r\nRunden efter (#11 eller 2 halvleg runde 3) og en masiv opd&aelig;kning af Crusaders kommer orkernes nr 7 gennem forsvaret og skorer orkernes 2. m&aring;l. Det er virkeligt skidt for Crusaders, der vikelig kan m&aelig;rke at de spiller med s&aring; mange uerfarne folk.<br />\r\n<br />\r\nCrusaders g&oslash;r kort proces p&aring; orkerne og skorer et perfekt m&aring;l to turer senere og udligner til 1-2 og er endnu engang med i kampen!!<br />\r\n<br />\r\nVi st&aring;r til at Crusaders kan udligne til 2-2 hvis alt g&aring;r vel. Men hva nu?! Orkerne udnytter at elverne ser efter bolden i stedet for at holde &oslash;je med orkerne!! De laver det, som vi inden for Bloodbowl kalder et quicksnap og de pulveraliserer forsvaret fuldst&aelig;ndigt, ikke en eneste elver st&aring;r op ved midterlinien og det lader til at i hvertfald den ene af journeyelverne ryger ud i casulty boxen!!<br />\r\n<br />\r\nSelv om folket k&aelig;mper bravt ser det ikke ud til at der er noget at g&oslash;re!! P&aring; nuv&aelig;rende tidspunkt er der kun 5 elvere der rent faktisk st&aring;r op. Resten ligner blot mulvarpeskud p&aring; banen, men de holder orkerne stangen, sp&oslash;rgsm&aring;let er bare om de kan holde dem hend til fl&oslash;jten lyder??<br />\r\nNEEEJ!!!! Det lykkes en snotling....ok, s&aring; en gobling at smutte gennem forsvarets ben og lave et sidste m&aring;l inden fl&oslash;jten lyder!! Det er da endnu en sorgens dag!! Det lad til at den rutchekurve er begyndt for de stakkels Crusaders, efter kampen mellem Crusaders og 2L!!<br />\r\n<br />\r\nDet er virkeligt en skuffende og &aelig;rgelig dag!! Det viser kun at ren gennemf&oslash;rt professionalisme og intelligent boldt&aelig;kke ikke altid er nok mod et uintelligent muskelhold, men jeg er ikke den der klager p&aring; Crusaders vejne, da de er professionele spillere, der ved at de kommer igen i en anden kamp, det er sikkert og vist!!!<br />\r\n<br />\r\nIndtil n&aelig;ste kamp....mod endnu et muskelhold, 3L i n&aelig;ste uge, siger jeg, Durkan MILFLover farvel og tak. <br />\r\nM&aring;tte dit kast v&aelig;re st&aelig;rkt og precist og din catch perfekt. Vi ses!!!</p>', 1243, 1224, 23, 0, 0),
