(94, NULL, 5, NULL, 63, NULL, 14000, 0, 1, 0, 0, 30, 20, 42, 55, '2008-04-06 20:59:23', '2008-04-06 00:00:00', '2008-04-08 07:28:47', 1, 2, '<p>Det s&aring; ellers s&aring; godt ud for Chaos efter en elver catcher var dr&aelig;bt og en lineman sendt p&aring; ferie for denne kamp. Steen var selv sikker p&aring; at lyset var slukket i starten af 2. halvleg. ved stillingen 1-1 og Chaos tur til at modtage bolden.</p>\r\n<p>Han havde dog ikke taget h&oslash;jde for nuffle. Chaos begyndte at br&aelig;nde rerolls hurtigere end lynet p&aring; 2 terning blocks. Da der ikke var flere rerolls kunne elverne udnytte et par turnovers til at l&oslash;be med bolden. Det kr&aelig;vede godt og pr&aelig;cist spil af Steen, men det var der rigeligt af.</p>\r\n<p>Afg&oslash;rende blev en illegal procedure som gav Steen en reroll. Den blev brugt godt til at dodge i m&aring;l til 2-1!!</p>', 1271, 1269, -15, 1000000, 1130000),
(126, NULL, 5, NULL, 63, NULL, 22000, 0, 1, 0, 1, 60, 60, 55, 42, '2008-05-04 21:39:28', '2008-05-04 00:00:00', '2008-05-04 21:39:27', 1, 3, '', 1284, 1246, -23, 1210000, 1300000),
(96, NULL, 5, NULL, 130, NULL, 19000, 1, 0, 0, 1, 60, 50, 32, 55, '2008-04-05 19:32:43', '2008-04-05 00:00:00', '2008-04-05 19:40:21', 2, 1, '<p>Pelle slog Steens Blitzer ihjel i f&oslash;rste tur i 1. halvleg og s&aring; var det op ad bakke derfra. Steen kom dog stadig foran 1-0, og fik senere givet lidt payback med et styrkefald p&aring; Pelles ene catcher. Pelle fik scoret nogenlunde hurtigt i 2. halvleg til 1-1 og fik efterf&oslash;lgende blitz. Det gav ham m&aring;let til 2-1 da Steens inkompetente thrower fejlede sit andet 3+ kast i kampen. Der blev i alt lavet 8 K.O. i kampen, 3 af Pelle og 5 af Steen. Det var alt i alt en ret h&aring;rd kamp. Det var en underholdende kamp, som m&aring;ske havde v&aelig;ret mere fair med et uafgjort resultat.</p>', 1157, 1272, 21, 1000000, 1000000),
