(161, NULL, 6, NULL, 130, NULL, 48000, -1, 1, 1, 0, 80, 140, 55, 87, '2008-07-29 11:52:05', '2008-07-29 00:00:00', '2008-07-31 13:30:54', 2, 3, '<p align="left">&nbsp;</p>\r\n<p align="left"><font size="2">En mere udf&oslash;rlig beskrivelse af kampen kan findes p&aring; gamesblogs, hvor Steen har skrevet en del om kampen.</font></p>\r\n<p align="left"><font size="2">Vejr: Sweltering heat. </font></p>\r\n<p align="left"><font size="2">The Toss vundet af Steen</font></p>\r\n<p align="left"><font size="2">kickoff resusltater</font></p>\r\n<p align="left"><font size="2">Perfect Defense</font></p>\r\n<p align="left"><font size="2">Weather Change: Sweltering heat(?!?)</font></p>\r\n<p align="left"><font size="2">Blitz</font></p>\r\n<p align="left"><font size="2">Perfect Defense </font></p>\r\n<p align="left"><font size="2">Der bliver en 3. halvleg pga en intet mindre en heroisk scoring hvor elveren udselig kan det hele p&aring; den halve tid og mennesker ikke kan finde dere egen r** med tre h&aelig;nder...</font></p>\r\n<p align="left"><font size="2">2+ dodge, </font><font size="2">2 terningers block = push ind i bolden, 5+ dodge med catcher hvor jeg bruger mit Team RR, 2+ dodge, 4+ pick up, 2+ dodge, 2+ GFI, 2+ GFI, 3+ Kast, 3+ grib af lineman, 2+ dodge af lineman. Marc l&oslash;ber ned og har 2 terninger ruller push, push og RR blev double both down, Jeg havde block det havde han ikke. Jeg blitzer hans catcher og l&aelig;gger ham p&aring; clean, og l&oslash;ber i m&aring;l. Steen havde 7 folk mod Marc''s 11.</font></p>\r\n<p align="left">&nbsp;</p>\r\n<p align="left"><font size="2">3.halvleg</font></p>\r\n<p align="left"><font size="2">Marc vinder the toss. Begge hold har 0 RR tilbage Steen har 6 folk mod Marc''s 11.</font></p>\r\n<p align="left"><font size="2">Perfect defense</font></p>\r\n<p align="left"><font size="2">Scoriung til 3-2 i tur 8 efter uendeligt meget stalling</font></p>\r\n<p align="left"><font size="2">Blitz. Menneskerne forholder sig i ro(n&aelig;sten). Elverne laver en completion</font></p>\r\n<p align="left"><font size="2">Kampen slutter med Steen 4 mand og Marc 9 mand.</font></p>', 1287, 1331, -14, 1360000, 1650000),
