(188, NULL, 1, 0, 150, NULL, 32000, 1, 0, 0, 1, 30, 30, 102, 108, '2008-08-11 21:42:34', '2008-08-11 00:00:00', '2008-08-12 12:39:49', 3, 0, '<p>Det er sv&aelig;rt at stille noget op n&aring;r man p&aring; tidspunkter i kampen var nede p&aring; 2 mod 10 m&aelig;nd/kvinder p&aring; banen.</p>\r\n<p>Med fem spiller i min Inj boks da kampen var f&aelig;rdig m&aring;tte jeg indse nederladet.</p>\r\n<p>Men det var en god kamp i den rette &aring;nd.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>6 spillere i Inj boksen ;-) men jo var sv&aelig;rt for steffen allerede at v&aelig;re 4 i undertal i tur 3 og jeg form&aring;ede at holde hans rat ogre helt ude af kampen.</p>\r\n<p>Men m&aring;tte ogs&aring; v&aelig;re min tur efter han gjorde n&aelig;sten det samme imod mine humans sidst;-)</p>\r\n<p>Nuffle l&aelig;nge leve</p>\r\n<p>Lac</p>\r\n<p>&nbsp;</p>', 1229, 1209, 27, 1360000, 1290000),
