(278, NULL, 7, NULL, 130, NULL, 27000, 0, 0, 1, 0, 80, 40, 53, 104, '2008-09-29 18:06:26', '2008-09-29 00:00:00', '2008-10-03 16:19:36', 2, 1, '<p align="left">I f&oslash;rste tur 1. halvleg hvor Reno havde drive, lavede han 2&nbsp;SI oppe p&aring; linien. Turen efter svarede min Tr&aelig;mand tilbage med en BH og s&aring; var kampen ligesom igang. Reno brugte alle 8 ture p&aring; at lave et m&aring;l, mens han pr&oslash;vede at h&oslash;vle alle elvere ud af banen, som han&nbsp;n&aelig;vnte var utrolig gode til at st&aring; i vejen lige meget, hvor meget han foulede, blockede og gjorde ved..&nbsp;Weather var Very Sunny (tror jeg. Den hvor man skal rulle for heat.)</p>\r\n<p align="left">2. halvleg startede Steen med sit drive. 7 mod 10 pga. heat. Steen Blev tvunget til at score p&aring; 2 ture og s&aring; stod det 1-1. S&aring; rullede Reno''s tog videre. Reno brugte resten af kampen p&aring; at score til 2-1. De sidste 4 ture var der en stakkels elver p&aring; banen som l&aring; omringet af 7 dv&aelig;rge som foulede ham hver eneste tur. Han overlevede, og gik stolt fra banen efter kampen som eneste tilbagev&aelig;rende elver.</p>', 1260, 1330, 17, 1620000, 1640000),
