(276, NULL, 7, NULL, 63, NULL, 29000, 0, -1, 0, 1, 70, 70, 97, 35, '2008-10-30 22:15:58', '2008-10-30 00:00:00', '2008-10-31 10:38:52', 2, 1, '<p>Der skulle hovmod til at f&aelig;lde 3L for f&oslash;rste gang efter 16 kampe. Efter 1-1 i f&oslash;rste halvleg er det 3L''s drive i anden halvleg og tingene er under kontrol. Pludselig f&aring;r Georg Ghoul med pass &oslash;je p&aring; en Wight der godt nok er sovset ind men stadig r&aring;ber p&aring; bolden. &quot;Spil mig og jeg scorer - Jeg er ligeglad med de Orc''er ved siden af mig. Se der er kun 8 felter til baglinien!&quot;.</p>\r\n<p>Georg regner p&aring; odds og t&aelig;nker p&aring; den mulige forside i n&aelig;ste nummer af &quot;Blood illustrated&quot; og beslutter sig for at g&oslash;re det. Han l&oslash;ber frem og passer til Wighten som griber bolden i andet fors&oslash;g. Willy Wight dodger ind i Verag ghoul chewers tackle zone og snubler! v&aelig;k var det glori&oslash;se play, v&aelig;k var h&aring;bet om forsiden og v&aelig;k var bolden... (der skulle rulles 3+ med skill reroll,2+,3+,2+,2+,2+ dvs ca 33% chance&nbsp;for at det var lykkedes)</p>\r\n<p>Med kort efter 3-4 mand i undertal kunne orc horden ikke stoppes og kampen ender 2-1 til orc''erne.</p>\r\n<p>Marc spillede en fin kamp uden at v&aelig;re synderlig heldig, men heller ikke forfulgt af uheld. I tur 15 havde han brugt 1 reroll for hele kampen mod 3L''s 8.</p>', 1303, 1321, 17, 1220000, 1650000),
