(272, NULL, 7, NULL, 70, NULL, 32000, 0, 1, 0, 1, 60, 70, 120, 88, '2008-10-06 19:52:09', '2008-10-06 00:00:00', '2008-10-13 21:36:53', 1, 2, '<p>Der blev kun rullet 20k i fortjeneste til Aids-incorperated, men nurgles rot ability''en gav en ekstra rotter, derfor st&aring;r winnings til 60k.</p>', 1195, 1272, -11, 1700000, 1700000),
