(270, NULL, 7, NULL, 63, NULL, 34000, 1, 1, 1, 0, 60, 30, 104, 35, '2008-09-17 20:36:51', '2008-09-17 00:00:00', '2008-09-18 21:14:14', 3, 3, '<p>En helt igennem fantastisk og underholdende kamp!!</p>\r\n<p align="left">Kampen starter med at Keld scorer p&aring; sit drive p&aring; 3 ture uden videre besv&aelig;r. Derefter scorer Steen p&aring; sit drive uden videre besv&aelig;r. Men, S&Aring; bliver det sp&aelig;ndende. Keld tager lidt en chance ned af banen i sit n&aelig;ste drive, Steen f&aring;r lagt ballcarrieren ned og bolden er fri. En skidt ting mod Wood Elves.. Steen hapser bolden og vil i samme moment kaste bolden og s&aring; ellers stikke af og komme foran, men ak. En interception af Keld p&aring; en ren 6''er g&oslash;r at Keld har bolden og l&oslash;ber ned og scorer til 2-1 ved halvleg.</p>\r\n<p align="left">2. halvleg starter med at Steen scorer uden videre problemer til 2-2 p&aring; 3 ture. S&aring; bliver det igen sp&aelig;ndende. Keld n&aring;r ikke at samle bolden op i sit drive da han fejler et dodge oppe ved midterlinien. Vupti, s&aring; st&aring;r der to Woodies ved bolden, og en 3 holder en af Kelds defensive folk. Keld n&aring;r dog i den efterf&oslash;lgende tur at f&aring; sine Mumier og andet godtfolk ned omkring bolden i et k&aelig;mpe slag. Det vinder Keld naturligvis stille og roligt, og stikker af med bolden. Wood elf er et hurtigt hold s&aring; p&aring; vej ned af banen bliver der sl&aring;et p&aring; Keld ballcarrier 3 gange med 2 terninger, UDEN at der bliver lagt nogen ned. H&aring;rd presset scorer Keld i tur 7 i 2. halvleg. Han turde simpelhen ikke &quot;stalle&quot; en sidste tur. 3-2 til Keld. I tur 8 i 2. halvleg scorer Steen p&aring; et oneturner m&aring;l og kampen slutter retf&aelig;rdigt 3-3. Bem&aelig;rk at Steen kun har en movement 9 spiller til r&aring;dighed til dette m&aring;l... HAPS!</p>\r\n<p align="left">[Ja en underholdende kamp og alt i alt nok et retf&aelig;rdigt resultat - Keld]</p>', 1332, 1309, -2, 1670000, 1610000),
(269, NULL, 7, NULL, 150, NULL, 42000, -1, 0, 1, 0, 50, 40, 53, 88, '2008-10-18 14:38:47', '2008-10-18 00:00:00', '2008-10-18 14:38:47', 0, 3, '', 1291, 1302, -27, 1670000, 1710000),
(268, NULL, 7, NULL, 63, NULL, 18000, 0, 1, 0, 1, 50, 60, 125, 97, '2008-09-02 20:36:20', '2008-09-02 00:00:00', '2008-09-10 10:35:45', 0, 1, '', 1203, 1359, -8, 940000, 1010000),
(267, NULL, 7, NULL, 91, NULL, 32000, 0, 1, 0, 1, 30, 40, 70, 120, '2008-09-20 20:32:01', '2008-09-20 00:00:00', '2008-09-20 22:41:27', 0, 1, '<div align="left">\r\n<p>Den deprimerede CBS tr&aelig;ners udtaleleser til Blitz News;</p>\r\n<p>Kampen startede meget &aring;bent da vi begge havde lige stor TV. Det eneste der skilte os ad var at AIDS fonden havde mere i FF, der afgjorde at han fik Fame''en.</p>\r\n<p>Eftersom jeg tabte &quot;coin tossed&quot; var det darkelves, der startede med at stille op og allerede ved det f&oslash;rste blok r&oslash;g der en runner ud med en BH''er (Hvilket var den v&aelig;rste skade holdet kom ud for i denne kamp og det eneste gode ved hele denne kamp!!!). Selv om AIDS fonden er et st&aelig;rkt hold med mange nastige evner lykkedes det mine elvere at fravriste ham bolden og sende den op i modsatte banehalvdel med et fornuftigt Hail Mary Pass og det s&aring; da ogs&aring; ud til at m&aring;let var hjemme i ca. 2 min. .....sagde jeg virkeligt minutter, jeg mente sekunder.... for et Blitz senere ligger min mulige m&aring;lscorer og raller p&aring; banen og i min tur har jeg efterladt min hjerne i garderobeskabet eller noget for jeg Blitzer med en forkert spiller og straffes med et flot par Skulls....</p>\r\n<p>F&oslash;rste halvleg slutter med et barmhjertigt 0 - 0 resultat og anden halvleg starter mit hold med 2 spillere i undertal, da jeg har en spiller i Casulty boksen og en anden spiller der ikke syntes at d&eacute;n kamp er v&aelig;rd at spille i mere (fejler sit 4+ slag fra &quot;Knoked out&quot; boksen).</p>\r\n<p>Elverne ligger stille og roligt ud med at f&aring; samlet bolden op og f&aring;r den bev&aelig;get op ad banen samtidigt med at bold b&aelig;reren bevogtes grundigt. Samtidigt er der to spillere der sendes i dybden for at have en mulihed for at score, men jeg tager en sk&aelig;bnesvanger beslutning om at placere dem for t&aelig;t sammen og derfor blev de fanget i Nurgle monsterets fangarme og havde ikke en chance for at undslippe.</p>\r\n<p>Imens pr&oslash;ver bold b&aelig;reren at man&oslash;vrere sig ud af de andre modstanderes knibtangs man&oslash;vrer og ender med at fumle en handoff til den sidste runner p&aring; banen og her kommer s&aring; hele baduljen til at F@#ke up og grunden til at elverne taber kampen efter min personlige mening.</p>\r\n<p>jeg m&aring; sige at spillerne performede med glans (utallige Dodges og Go for it''s, s&aring; Mike til sidst fik gr&aring; h&aring;r og t&aring;rer i &oslash;jnene), men n&aring;r man i praksis er 4 spillere i undertal og man misser de kritiske rul, s&aring; er der kun s&aring; meget man kan g&oslash;re. Samtidigt med at AIDS fonden havde placeret sig taktiskt godt og havde nogle fortr&aelig;ffelige terninge rul s&aring; m&aring; man sige at han fortjente den 1 - 0 sejr, som blev resultatet til aller aller sidst i 2. halvleg, 8. tur.</p>\r\n<p>Med et resigneret udtryk og bitterhedens skam p&aring; sine skuldrer vandrer CBS'' tr&aelig;ner tilbage hvor han kom fra for at gr&aelig;mme sig i ensomhedens bitre m&oslash;rke, nu da dr&oslash;mmen om at n&aring; finalerne er lige s&aring; lang borte som l&oslash;ftet om en ungm&oslash;s jomfrublod.</p>\r\n</div>', 1137, 1213, -11, 1640000, 1640000),
