(262, NULL, 7, NULL, 150, NULL, 33000, 0, -1, 1, 0, 70, 60, 35, 88, '2008-09-10 20:59:06', '2008-09-10 00:00:00', '2008-09-11 09:19:59', 4, 0, '<p>Lasse havde virkelig ikke heldet med sig. Eller ogs&aring; havde jeg det bare. F&oslash;rste kick-off f&aring;r jeg blitz, tacklezone p&aring; bolden. Efter vores tur 1 har Lasse 3 blitzere ude! Overtallet g&oslash;r det let at score. 2. kickoff bliver igen blitz og det hele gentager sig til 2-0 i halvleg.</p>\r\n<p>2. halvleg er pr&aelig;get af en ogre der ingenting vil og lidt flere human casualties. Den ene cas Lasse laver regenereres straks.</p>\r\n<p>&nbsp;</p>\r\n<p>Nuffle hates me :-P</p>\r\n<p>Lac</p>', 1279, 1326, 30, 1590000, 1550000),
