(259, NULL, 7, NULL, 91, NULL, 23000, 0, 0, 0, 1, 30, 80, 70, 53, '2008-10-11 16:10:35', '2008-10-11 00:00:00', '2008-10-12 12:51:25', 0, 2, '<div align="left">\r\n<p>Det var en &quot;bl&oslash;d&quot; kamp vi havde i denne omgang i og med at der ikke var nogle spillere der d&oslash;de eller fik permanente skader. Godt nok var der brug for en Apoteker p&aring; begge hold for at fjerne nogle SI skader, men til denne kamp havde de begge noget ordentligt medicin med, dr kurerede spillerne.</p>\r\n<p>Desv&aelig;rre for mit hold lykkedes det dem ikke at holde dv&aelig;rgenen p&aring; afstand og et almindeligt fejlet throw, hurtigt efterfulgt af en rerolled 1''er resulterede i at dv&aelig;rgene kunne f&aring; fat i bolden et par felter fra midterlinien og havde tid nok til at komme ned og score i f&oslash;rste halvleg.</p>\r\n<p>Anden halvleg gik s&aring; med at ikke blive tampet for h&aring;rdt......yah.... lad os bare sige at jeg havde hele 3 spillere p&aring; banen i 7. runde hvor de scorede deres andet m&aring;l og en af dem stod op.</p>\r\n<p>Det skal dog siges at jeg havde en chance hvor jeg fik bolden ud af Reno''s cage, men fejlede opsamlingen med en 3''er hvor jeg skulle bruge en 4''er (typisk!!).</p>\r\n<p>Alt i alt en hyggelig kamp der (endnu en gang) ikke faldt i mit fav&oslash;r og stiller mig langt fra en placering til finalen.</p>\r\n</div>', 1159, 1287, -13, 1640000, 1650000),
