(248, NULL, 7, NULL, 150, NULL, 30000, 1, 0, 1, 0, 40, 60, 88, 104, '2008-09-01 18:07:38', '2008-09-01 00:00:00', '2008-09-03 14:55:50', 4, 0, '<p align="left">I denne kamp gik absolut alt galt for mine woodelfs. Jeg rullede 29 ettere i l&oslash;bet af kampen, og n&aelig;sten samtlige ture endte i et turnover til Lasse. Derudover havde han efter 5 ture givet mig 3 K.O og 3 Cas. Kampen sluttede dog med at han kun ialt gav mig 6 K.O, og 4 Cas. Av av. Kampen varede vel ca. 1&frac12; time. Det siger lidt om hurtigheden af mine ture. Nuffle var lidt grov i filten mod mig, men forbarmede sig over mig til den n&aelig;ste kamp mod Niels. Stakkels Niels.</p>\r\n<p align="left">&nbsp;</p>\r\n<p align="left">Steen.</p>\r\n<p align="left">Og husk nu topscoreren Ogren Sir Lamorak ;-) med 2 TD''s</p>\r\n<p align="left">Lasse</p>', 1296, 1343, 30, 1500000, 1580000),
