(298, NULL, 1, 0, 91, NULL, 27000, -1, 1, 0, 1, 20, 50, 43, 40, '2008-10-22 19:54:31', '2008-10-22 00:00:00', '2008-10-22 19:54:31', 0, 3, '', 1143, 1329, -12, 1880000, 1900000),
(327, NULL, 1, 0, 130, NULL, 35000, -1, 0, 0, 1, 30, 60, 84, 104, '2008-12-22 18:05:22', '2008-12-22 00:00:00', '2008-12-23 13:43:25', 3, 4, '<p align="left">Lad mig bare sige at denne kamp er intet mindre end historisk!</p>\r\n<p align="left">Det korte resum&eacute; er at Niels var foran 3-0, men Steen kom igen og vandt 3-4. Forklaring kommer her.</p>\r\n<p align="left">1. halvleg.</p>\r\n<p align="left">Da kampen starter er Steen t&aelig;t p&aring; at f&aring; 2xFAME, men n&oslash;jes med alm. FAME. Niels starter drive, og scorer planm&aelig;ssigt til 1-0, selvom Steen f&aring;r lavet en interception (5+ med RR), og Steen ogs&aring; laver en CAS p&aring; Niels. I Steens efterf&oslash;lgende drive f&aring;r Niels BLITZ og l&oslash;ber ned og scorer i sin tur 3 til 2-0. I Steens n&aelig;ste drive, ruller Steen halvvejs i sin f&oslash;rste tur double 1 og Niels udnytter det til promte at s&aelig;tte 3-0 p&aring; tavlen i sin 5. tur. Av, det er g&aring;et st&aelig;rkt for Niels, og Steen har v&aelig;ret ret uheldig. I Steens n&aelig;ste drive i halvlegen er Niels igen MEGET t&aelig;t p&aring; at score, men fejler sit 2+ grib i endzone til 4-0. Kampen skiftede fuldst&aelig;ndig karakter efter Niels fejlede m&aring;l. Steen begyndte at lykkedes med ting og Niels det modsatte. Steen tyrer en af Niels folk i publikum, og f&aring;r fat i bolden. i tur 7 scorer Steen til 3-1. I det drive gav Steen en KO til Niels nr. 9. En lille reducering i en kamp som Steen allerede s&aring; som tabt, da han slet ikke kunne styre Niels folk p&aring; en halv t&oslash;nde land.</p>\r\n<p align="left">2. halvleg.</p>\r\n<p align="left">Steen starter drive, og scorer til 3-2. I det drive slog Steen en af Niels Witchelves ihjel, men han blev reddet til MISS. Her kommer Niels nr. 9 med igen og det er 9 Darkelf mod 11 woodies. Steen for breaket Niels drive da Niels fejlede at gribe et 2+ dump off, og vupti! 3-3. Kampen var nu helt &aring;ben igen da Niels skal starte drive med 4 ture tilbage til ham og 3 til Steen. Steen f&aring;r PERFECT DEFENCE, og det tvinger Niels til at skifte side. Steen n&aring;r hen i vejen og f&aring;r s&oslash;rme lavet endnu en interception(6+ rent)!! Niels bliver nu tvunget til at blitze defensivt, og det benytter Steen sig af og f&aring;r scorer til 3-4 i sin tur 8. Niels fors&oslash;ger sig med et &quot;one turn&quot; m&aring;l, men fejler. Et historisk comeback var i hus, og The Good Angels virker klar til playoff med 9 sejre i tr&aelig;k!</p>', 1131, 1449, -4, 1990000, 2010000),
