(294, NULL, 1, 0, 150, NULL, 34000, 0, -1, 0, 1, 30, 40, 102, 40, '2008-10-13 18:43:25', '2008-10-13 00:00:00', '2008-10-14 17:57:19', 2, 1, '<p align="left">Lasse fik 480.000 i inducements, men det havde han faktisk ikke beh&oslash;vet. Han k&oslash;bte 2 APO, 2 Bloodweisers, og 2 playcards.</p>\r\n<p align="left">Han fik ikke brug for APO''s, ej heller de to playkort.</p>\r\n<p align="left">Steen startede kampen og scorede p&aring; 3 ture, og cleanhittede en del. Men derefter svingede kampen helt i Lasses fav&oslash;r. Lasse gav Steen 3 Cas, hvor han rullede 3 D&Oslash;DE!! Den ene blev konverteret BH, som s&aring; d&oslash;de senere i kampen alligevel! Ret vildt.</p>\r\n<p align="left">Steen fejlede n&aelig;sten samtlige terningrul i hele 2. halvleg, og Lasse gik IKKE gennem Armour hele 5 gange p&aring; hele 2. halvleg. Alt i alt en skidt kamp for Steen, hvor alt gik galt. En ST 4, Side Step, Guard blitzer d&oslash;de, og Steens Block, +MA Gobbo d&oslash;de ogs&aring;, efter at v&aelig;re reddet en gang tidligere fra d&oslash;den. :(</p>\r\n<p align="left">&nbsp;</p>\r\n<p align="left">Orcer kan &aring;benbart ikk st&aring; for nonners charme</p>\r\n<p align="left">Og k&oslash;bte kun 1 APO som jeg ogs&aring; brugte p&aring; et kill, og ellers k&oslash;bte jeg et ekstra reroll, 2 Bloodweiser og 2 play cards hvor jeg brugte det ene til at give mit hold armor 8 i et drive som s&aring; var steens f&oslash;rste drive.</p>\r\n<p align="left">S&aring; jo fik brugt APO og det ene playkort s&aring; m&aring;ske ikke helt rigtig referat</p>\r\n<p align="left">&nbsp;</p>', 1283, 1347, 19, 1610000, 2090000),
