(306, NULL, 8, NULL, 63, NULL, 62000, 0, 1, 1, 0, 40, 140, 53, 35, '2008-11-22 18:17:51', '2008-11-22 00:00:00', '2008-11-23 17:47:23', 0, 4, '<p>Der skulle to kampe til for at sl&aring; Reno!</p>\r\n<p>I den f&oslash;rste kamp spillede vi 1-1, men det lykkedes at fjerne Reno''s runner og han stillede derfor med en rookie runner til semifinalen. Det hjalp de ud&oslash;de i to konkrete tilf&aelig;lde hvor Reno''s runner g&aring;r ned med bolden pga. en both down.</p>\r\n<p>I f&oslash;rste halvleg rullede Reno en del skulls og det hjalp til at bryde hans drive 2 gange og derefter score.</p>\r\n<p>I anden halvleg blev det relativt hurtigt 3-0 og dv&aelig;rgenes vilje var derefter lidt kn&aelig;kket. Resten af kampen gik med at foule de ud&oslash;de samt at score det fjerde m&aring;l.</p>', 1281, 1299, -29, 1540000, 1770000),
