(309, NULL, 1, 0, 150, NULL, 35000, 0, 0, 0, 1, 50, 70, 61, 40, '2008-11-30 17:34:45', '2008-11-30 00:00:00', '2008-11-30 20:44:48', 0, 3, '<p>Nuffle Hates Me</p>\r\n<p>LAC</p>', 1288, 1387, -17, 1900000, 1950000),
(311, NULL, 8, NULL, 130, NULL, 64000, -1, 0, 0, 1, 100, 120, 35, 104, '2008-12-05 22:39:03', '2008-12-05 00:00:00', '2008-12-06 11:15:50', 1, 4, '<p align="left">Steens kampreferat.</p>\r\n<p align="left">Kelds inducements var: 1 Bribe, 1 Bloodweiser, 1 playcard til 50k.</p>\r\n<p align="left">Kampen startede med at jeg fik FAME. Altid en k&aelig;rkommen gave. Jeg starter oven i k&oslash;bet med drive ogs&aring;. Jeg scorede p&aring; to ture uden videre problemer. Keld foulede i sin f&oslash;rste tur og blev reddet af sin bribe. Der blev kun foulet en gang mere hvor der heller ikke skete noget. Igen af Keld.</p>\r\n<p align="left">Kelds drive. Han l&oslash;ber ned i backfield og samler op og intet voldsomt sker. Jeg f&aring;r nogle folk op omkring hans cage, og da Keld som det f&oslash;rste i turen efter fejler et GFI med en mumie, som faktisk blev K.O. af det. Det g&oslash;r ondt n&aring;r man falder i BB. S&aring; er sagen b&oslash;f. Kort efter st&aring;r det 2-0 til Woodies. Og det bliver ogs&aring; halvlegsresultatet, da jeg scorer i min tur 8, s&aring; Keld kun har en tur tilbage til at sl&aring; lidt bagefter. Der er p&aring; dette tidspunkt ingen CAS p&aring; nogen af holdene. Keld havde faktisk en Mumie og sin &quot;Thrower&quot; i K.O, men de kom begge ind ved halvleg.</p>\r\n<p align="left">2. halveg starter med Kelds Drive. Han f&aring;r High kick igen. Indtil nu har det v&aelig;ret nogle stille og rolige kickoff resultater som ekstra RR eller vejret som g&aring;r fra nice til nice. Keld arbejder sig frem i den ene side, og elverne f&oslash;lger glade med. Keld f&aring;r ret effektivt skiftet side, og selvom Woodierne n&aring;r hen og genere en del, s&aring; f&aring;r Keld scoret vha. godt spil. 2-1.</p>\r\n<p align="left">Steens drive. Alt g&aring;r som planlagt, indtil Steens anden tur hvor Tr&aelig;manden fejler et 3 terningsrul, og f&aring;r ikke lov at bruge RR. Keld er med det samme over Steens rookie catcher som IKKE bliver lagt ned, selvom Keld brugte RR. Keld havde 80 % chance for at l&aelig;gge&nbsp;catcheren&nbsp;ned. Steens held. N&aelig;ste tur s&aring; scorer Steen til 3-1 og kampen er reelt afgjort. Der var virkelig sp&aelig;nding p&aring; inden 3-1 m&aring;let. Da Keld skal starte sit drive med 3 ture igen kommer der Pitch Invation. Steen har FAME og ligger 5 af Kelds folk ned. Keld svarer igen og ligger 4 af Steens folk ned. Steen fik imidlertid brudt Kelds drive og scorer et kosmetisk m&aring;l til 4-1 i sin tur 8. anden halvleg. Kampen sluttede med en CAS lavet af Keld som slog Steens rookie lineman ihjel. Alts&aring; en forholdsvis fredelig kamp.</p>\r\n<p align="left">Finalen var meget pr&aelig;get af to nerv&oslash;se spillere. Vi glemte begge at rulle vores dodge, og GFI. Samtidig glemte den anden at holde &oslash;je, s&aring; et par gang m&aring;tte vi lige spole tilbage og f&aring; gjort tingene ordentligt. Det bet&oslash;d bl.a. at Kelds Mumie fejlede sit GFi som vi havde glemt at rulle. Der var et par folk nede og se finalen, og det var rigtig hyggeligt med lidt publikum. Kampen blev generelt afviklet i en hyggelig og rolig atmosf&aelig;re.</p>\r\n<p align="left">Lige en slutnote: Der b&oslash;r m&aring;ske v&aelig;re en form dommer til at holde &oslash;je med finalekampe i fremtiden. De to finalespillere glemte som n&aelig;vnt nogle ret vigtige rul undervejs, som m&aring;ske ville have &aelig;ndret kampens forl&oslash;b radikalt. En Umpire ville m&aring;ske v&aelig;re godt til n&aring;r &aring;rsturneringen skal afsluttes i januar.</p>\r\n<p align="left">Steen.</p>', 1328, 1404, -19, 1820000, 2020000),
