(336, NULL, 9, NULL, 130, NULL, 36000, -1, 1, 1, 0, 50, 30, 104, 35, '2009-01-02 23:35:45', '2009-01-02 00:00:00', '2009-01-03 13:21:43', 1, 2, '<p align="left">Dette var en h&oslash;jdramatsik og sp&aelig;ndende kamp!</p>\r\n<p align="left">Keld fik 520.000 i inducements. De blev brugt p&aring; en wizard, en bribe, en bloodweiser og et playcard til 200.000. Det blev spar 6, som giver en af mine spillere really stupid. Det blev&nbsp;Steens wardancer med mighty blow og guard som blev really stupid. Weather var nice.</p>\r\n<p align="left">Kickoffresultatet var weather, som gik fra nice til nice.</p>\r\n<p align="left">I Kelds f&oslash;rste tur laver han K.O. p&aring; Steens tr&aelig;mand, og MISS p&aring; en lineman. S&aring; var kampen igang. Keld fouler ogs&aring; og smider endnu en af Steens folk ud med MISS, men skal dog bruge sin Bribe da han ruller en dobbelt.</p>\r\n<p align="left">Keld bruger h&aring;rdt presset 8 ture p&aring; at score til 1-0 selvom Steen kun havde 7 elevere p&aring; banen det meste af halvlegen. Keld lavede endnu en MISS midt i halvlegen som Steen valgte at bruge APO p&aring;, som s&aring; r&oslash;g i reserves. Keld havde bolden midt p&aring; Steens halvdel, da Steen pr&oslash;ver at leape og fejler selv med team RR, som g&oslash;r at han ikke f&aring;r sl&aring;et p&aring; den Ghoul der har bolden. Keld bruger s&aring; sin Tackle man til at blitze den assist Steen havde f&aring;et rykket hen v&aelig;k, og kan stille og roligt l&oslash;be i m&aring;l.</p>\r\n<p align="left">Steen pr&oslash;ver i tur 8 at lave et one-turn m&aring;l, men glemmer at f&aring; rykket alt rigtigt, s&aring; han ikke kan lave det. 1-0 til Keld ved halvleg.</p>\r\n<p align="left">Da 2. halvleg starter er det igen 11 mod 11.</p>\r\n<p align="left">Steen starter drive i 2. halvleg, og scorer uden nogen videre problemer til 1-1 p&aring; 2 ture. Kickoff var high kick.</p>\r\n<p align="left">Keld starter sit drive med endnu et weather change fra nice til nice. Bolden bliver samlet op i h&oslash;jre side, og Keld f&aring;r lavet et cage midt p&aring; banen, men i denne halvleg har Steen sin tr&aelig;mand med igen og Keld m&aring; droppe at l&oslash;be ned gennem midten. Keld k&oslash;rer derfor over i venstre og fejler sidst i turen med sin mumie som ryger i K.O for anden gang i kampen. Turens RR var blevet brugt. Steen f&aring;r sl&aring;et bolden fri, og fejler at samle op ude ved sidelinien s&aring; bolden ryger til throw-in. Bolden bliver smidt godt ned p&aring; Steens halvdel, hvor Keld har en Ghoul st&aring;ende med 3 elevere omkring sig. Keld blocker lidt hist og her, og tager s&aring; en chance med sin Ghoul, som skal dodge p&aring; 4+ v&aelig;k fra Steen mands med Tackle. Keld fejler, men redder den med sit team RR, og derefer 3+ dodge, 3+ samle bold op og 2+ GFI til m&aring;l. 2-1 til Keld.</p>\r\n<p align="left">Steen har nu 3 ture til at udligne, og ingen af spillerne har flere RR tilbage. Kickoff er igen High Kick. Steens f&oslash;rste block bliver et double skull. I Kelds tur laver han som det f&oslash;rste et blitz med sin mumie uden Block, som bliver skull - both down. Endnu en turover. Steen har nu to ture til at pr&oslash;ve at lave et m&aring;l. Steen f&aring;r bolden i &quot;sikkerhed&quot; og f&aring;r folk ned af banen. Kld l&aelig;gger ingen ned, men f&aring; d&aelig;kket op rundt omkring. Keld bruger her sin wizard til at l&aelig;gge Steens thrower ned, som bliver stunned, Steen skal pludselig til at samle op, kaste og gribe alt p&aring; 2+ men uden rr. Steen fejler at gribe bolden, og det afg&oslash;rer kampen. Keld blocker lidt i sin tur 8, men intet sker med Steens folk.</p>\r\n<p align="left">Keld vinder en vildt sp&aelig;ndende kamp 2-1 og er fortjent videre til semifinalen.</p>\r\n<p align="left">Keld havde undervejes i kampen et par heldige ting, s&aring;som to mand i i kampens f&oslash;rste 2 blocks. Steen fik tilgeng&aelig;ld straffet en mumie med 2 gange K.O som selv med en Bloodweiser blev ude 2 gange, og et par skelleter blev ogs&aring; stunned. S&aring; p&aring; den front gik det lige op. Keld bliver faktisk &quot;reddet&quot; af sin egen fejl i f&oslash;rste halvleg tur 7. Han kommer til at lave et block med en zombie som ikke har block. Han troede han havde 2 terninger, men kun en. Han ruller skull, og m&aring; bruge team RR til push. Ved at bruge sit team RR t&oslash;r Keld ikke kaste bolden i endzone senere i turen. Keld havde bare glemt at Steens Pass block catcher stod til at kunne l&oslash;be hen og pr&oslash;ve at gribe bolden p&aring; 5+ med RR fordi han har catch. Held i uheld for Keld. (M&aring;ske) Da bolden bliver kastet in daf publikum lander den f&oslash;rst op af to af Steens elevere, men bouncer v&aelig;k fra dem s&aring; Keld kan samle uden nogen tacklezones p&aring; bolden. og lidt heldigt for Keld da han er lidt outnumbered p&aring; banen s&aring; Steen nok ville have scoret lidt efter hvis det var. Der var ingen som var decideret uheldige, men et par sm&aring; ting tippede lige lidt i Kelds fav&oslash;r, s&aring; han kunne snuppe en sejr i en godt spillet og MEGET t&aelig;t kamp.</p>', 0, 0, 0, 2240000, 1720000),
