(342, NULL, 9, NULL, 63, NULL, 60000, -1, 0, 1, 0, 100, 100, 35, 84, '2009-01-19 00:04:36', '2009-01-19 00:00:00', '2009-01-19 08:25:21', 1, 4, '<p>4-1 lyder som en lidt ensidet kamp, men s&aring;dan var det nu ikke i lang tid. Takket v&aelig;re Steen''s observationer, har vi et blow-by-blow account af kampen (n&aelig;sten). Her f&oslash;ler highlights.</p>\r\n<p>Inducements: Keld tager en wizard til 150K</p>\r\n<p>Fame g&aring;r til Keld, Vejret er nice</p>\r\n<p>Tur 1:</p>\r\n<p>Niels v&aelig;lger at modtage og f&aring;r quick snap. Bolden kikckes out of bounds. Der var lidt &aring;bningsnerver p&aring; i starten og en af Niels''s spillere kom for sent ud af omkl&aelig;dningsrummet. Niels spillede derfor med 10 mand.</p>\r\n<p>Niels rullede 3 et''ere og den sidste giver turnover. Keld samler bolden op.</p>\r\n<p>Tur 2:</p>\r\n<p>Niels f&aring;r d&aelig;kket godt op men kan ikke v&aelig;lte ballcarrier. Keld fik lidt ufrivilligt inviteret til klumpsspil pga sidesteppere.</p>\r\n<p>Tur 3:</p>\r\n<p>Niels blocker ballcarrier med 7 terninger, men til ingen nytte. F&aring;r knock-outed en mand og udl&oslash;ser turnover.</p>\r\n<p>Keld f&aring;r blocket sin ballcarrier n&aelig;sten fri og er et 3+ dodge med reroll fra at score. Det kunne han ikke.</p>\r\n<p>Tur 4:</p>\r\n<p>Niels snupper bolden og scorer til 1-0</p>\r\n<p>Kickoff er cheering fans, RR til Keld, touchback. Keld blocker lidt s&oslash;lle men ellers ok tur.</p>\r\n<p>Tur 5:</p>\r\n<p>Niels l&aelig;gger ballcarrier, f&aring;r fat i bolden med MANGE terningerul og fejler sit GFI. Bolden er fri.</p>\r\n<p>Keld pr&oslash;ver at f&aring; fat i bolden men fejler igen et 3+ dodge med RR.</p>\r\n<p>Tur 6:</p>\r\n<p>Niels tager bolden og scorer til 2-0</p>\r\n<p>Kick-off brilliant coaching. RR til Keld.</p>\r\n<p>Keld samler bolden op og laver cage + lidt blocks.</p>\r\n<p>Tur 7:</p>\r\n<p>Niels d&aelig;kkede kun lidt op og har ikke flere team RR.</p>\r\n<p>Keld f&aring;r bolden godt ned af banen og st&aring;r 2 felter fra endzone.</p>\r\n<p>Tur 8:</p>\r\n<p>Niels sl&aring;r p&aring; ballcarrier med 1 terning og f&aring;r clean hit. Niels griber bolden med &eacute;n som har flyttet allerede.</p>\r\n<p>Keld pr&oslash;ver desperat at f&aring; bolden og bliver tvunget til 6+ dodge i sit blitz. Ruller 4, RR 5 og halvlegen slutter 2-0.</p>\r\n<p>2. Halvleg, Keld''s drive</p>\r\n<p>Tur 9:</p>\r\n<p>Keld fejler at samle bolden op dybt p&aring; egen halvdel.</p>\r\n<p>Niels sender 2 mand efter bolden og stunner en ghoul.</p>\r\n<p>Tur 10:</p>\r\n<p>Keld samler op og erkl&aelig;rer pass, men har glemt pass block fyren hos Niels. Der sker dog ingen interception. Completion og handoff. Bold kommer langt frem, men er relativt ubeskyttet.</p>\r\n<p>Niels blocker ballcarrier med witch elf: push+push, Block RR Skull.</p>\r\n<p>Tur 11 (og 10):</p>\r\n<p>Keld scorer efter dodge, handoff og GFI (som koster RR). Stillingen er 2-1 og kampen er &aring;ben igen.</p>\r\n<p>Kick-off riot og pludselig er det tur 10 igen. Niels f&aring;r folk ned af banen, men fejler boldopsamlingen.</p>\r\n<p>Tur 11:</p>\r\n<p>Keld laver k.o. og f&aring;r bolden ind i cage.</p>\r\n<p>Niels sl&aring;r p&aring; ballcarrier med 1 terning og l&aelig;gger ham. bold fri p&aring; jorden.</p>\r\n<p>Tur 12:</p>\r\n<p>Keld laver k.o. blocker lidt mere. Samler bold op, hand-off til mand med scoringschance fejler og bold bouncer lige i armene p&aring; en elver. Keld bruger wizard og l&aelig;gger ballcarrier ned.</p>\r\n<p>Niels samler bold op og passer. Mumie intercepter med kold 6''er, men safe throw redder Niels. hand-ogff og m&aring;l til 3-1.</p>\r\n<p>Tur 13:</p>\r\n<p>Kick-off = get the ref. Begge hold er stadig fuldtallige (nul casualties!). Keld samler bold, men bruger igen RR p&aring; det.</p>\r\n<p>Niels l&oslash;ber 2 mand til ballcarrier og d&aelig;kker op.</p>\r\n<p>Tur 14:</p>\r\n<p>Keld SKAL score, men fejler et GFI for at komme ud af pass block range.</p>\r\n<p>Niels samler op men fejler sit kast.</p>\r\n<p>Tur 15:</p>\r\n<p>Keld blitzer, men double skull og turnover.</p>\r\n<p>Niels samler op og scorer til 4-1.</p>\r\n<p>Tur 16:</p>\r\n<p>Kick-off = weather som bliver nice.</p>\r\n<p>Keld laver kampens eneste cas som bliver kill. Apo brugt til BH. Niels laver blitz og l&aelig;gger sig.</p>\r\n<p>&nbsp;</p>\r\n<p>Samlet set havde Keld 7 turnovers og Niels havde 5. Alt i alt en sev&aelig;rdig kamp, hvor de ud&oslash;de nok spillede lidt for meget p&aring; elvernes pr&aelig;misser, n&aring;r nu de ikke ville i casualty boksen. De sm&aring; ting p&aring;virker ogs&aring; s&aring;dan en kamp. 3-4 gange laver Keld''s mumie uden block en meyer som skal RR''s. De RR''s savner man bestemt senere i kampen. Niels viste et meget homogent udviklet hold som er en kredit til&nbsp;coachen. En v&aelig;rdig vinder af mesterskabet, som oveni k&oslash;bet kom med p&aring; et wild-card til play-off.</p>\r\n<p>&nbsp;</p>', 0, 0, 0, 2080000, 2230000);
