(448, NULL, 12, NULL, 150, NULL, 29000, 0, 0, 1, 0, 40, 70, 25, 169, '2009-04-21 19:59:21', '2009-04-21 00:00:00', '2009-04-21 20:27:40', 0, 1, '<p>Ja kampen sluttede brat da Andre skulle fielde da jeg havde breaket hans drive og scoret til 1-0 valgte han at concede da han kun kunne fielde 2 spillere med 3 i casulty boksen og 6 i knock out.</p>\r\n<p>&nbsp;</p>\r\n<p>Derfor den lave m&aring;lscore</p>', 1192, 1289, -12, 1140000, 1710000),
(500, NULL, 11, NULL, 91, NULL, 26000, 1, 1, 0, 1, 50, 80, 189, 202, '2009-04-06 21:20:53', '2009-04-06 00:00:00', '2009-04-06 21:20:53', 1, 1, '', 1085, 1174, 5, 1280000, 1270000),
(499, NULL, 11, NULL, 63, NULL, 23000, 0, 1, 1, 0, 40, 70, 154, 163, '2009-05-20 20:48:10', '2009-05-20 00:00:00', '2009-06-01 14:37:15', 2, 3, '<p>Steffen kandiderer til &aring;rets heldigste m&aring;l til 3-2 som forl&oslash;b s&aring;ledes:</p>\r\n<p>Norse er i angreb og har bolden. Et quick pass st&aring;r mellem Norse og et touchdown. Thrower l&oslash;ber i position og skal til at passe. Steffen''s pass block mand laver et 4+ og 3+ dodge og f&aring; en interception mulighed. Det lykkedes!!. Han pr&oslash;ver i sin tur at dodge v&aelig;k hvilket fejler og bolden sl&aring;s fri. Nu skal Norse thrower blot samle bolden op, lave et handoff og s&aring; er der TD. Sure hands fejler og bolden bouncer ind i 3 norse tacklezones.</p>\r\n<p>Den slags bekymrer ikke steffen og han hopper ind i 3 tacklezones og samler bolden op p&aring; en 6''er, pass''er derinde fra igen p&aring; en 6''er. Hans goblin griber efter catch reroll og l&oslash;ber i m&aring;l.</p>\r\n<p><img src="/mambots/editors/fckeditor/editor/images/smiley/msn/angry_smile.gif" alt="" /></p>', 1223, 1178, -18, 1700000, 1730000),
