(568, NULL, 13, NULL, 63, NULL, 66000, -1, 1, 0, 1, 40, 160, 216, 154, '2009-06-17 20:48:00', '2009-06-17 00:00:00', '2009-06-18 11:04:54', 0, 1, '<p>Dv&aelig;rgene inducede 2 bribes. Kampen startede fint for Norse da bolden bliver kicket ud til sidelinien og dv&aelig;rgene fejler deres pickup. bounce ud over sidelinien og throw-in lander mellem 3 norse spillere. Norse fejler dog ogs&aring; deres pickup, men f&aring;r alligevel scoret i tur 7 efter at have stallet 3 ture. Dv&aelig;rgen smadrer Norse folk ud af banen og halvlegen ender 4-1 i casualties til dv&aelig;rgene.</p>\r\n<p>Den tendens forts&aelig;tter i anden halvleg hvor Norse har sv&aelig;rt ved at finde nogen at spille bolden til. Dv&aelig;rgene bryder og kan l&oslash;be i m&aring;l p&aring; 3 ture med kun 1 GFI. Norse Trolden DODGER (5+) ud for at kunne blitze ballcarrier og det lykkedes at l&aelig;gge ham ned. Dv&aelig;rgen skal nu med en troll slayer samle op (4+) og lave 4 GFI p&aring; de 3 ture for at score. pick-up og det f&oslash;rste GFI lykkedes. Trolden blitzer igen og ender med en TZ p&aring; ball carrier. Han blitzer trolden og skal f&oslash;lge op hvorved han igen skal bruge 2x2GFI for at n&aring; det. De f&oslash;rste 2 lykkedes. Norse skal s&aring; dodge og f&aring; et push med reroll for at stoppe m&aring;let. Det lykkedes ogs&aring; og dv&aelig;rgene kan ikke n&aring; at score mere. Norse havde til sidste 4 mand p&aring; banen mod 10.</p>', 1275, 1203, -17, 1450000, 1720000),
