(858, NULL, 15, NULL, 130, NULL, 74000, 0, -1, 0, 1, 100, 60, 104, 181, '2009-11-21 15:14:55', '2009-11-21 00:00:00', '2009-11-22 12:03:51', 5, 4, '<p style="text-align: left;">Den her kamp var the stuff of legend!</p><p style="text-align: left;">Steen starter drive i 1. halvleg og scorer planm?ssigt til 1-0, Niels udligner ligeledes planm?ssigt til 1-1. Da Steen har drive bagefter, fejler hans Thrower et kast p? 3+ med 2 ettere. Bolden ligger p? jorden midt p? banen, og Niels udnytter det hurtigt til at komme foran 2-1. Steen starter s? drive igen, og f?r bolden smidt ned til en wardancer som skal lave et 2+ dodge, og skynder sig at fejle det p? to ettere. Niels havde turen inden fejlet et GFI med RR s? han kunne ikke n? at score i tur 8 1. halvleg.</p><p style="text-align: left;"><br></p><p style="text-align: left;">2-1 til Niels ved halvleg, og han skulle starte drive i 2. halvleg. Niels fra 2. halvlegs start 10 mod 9, og er resten af kampen i overtal, men 1-2 spillere. Niels havde en meget aktiv Drityplayer, som bla. foulede en wardancer til d?de, som blev APO til BH. Niels Assassin havde ogs? en god dag p? kontoret med op til flere stabs som gav CAS og K.O og ellers stunnede en del. Steen er ved at noget desperat, s? da Niels er lidt uforsigtig med sin runner, tager Steen en chance og blitzer runneren som ikke havde nogen venner med sig dybt nede p? egen halvdel. Steen blitzer med sin Catcher (som senere blev foulet til BH) og l?gger Niels runner ned selvom det var to terninger imod, og snupper bolden. Niels runner bliver i processen stunned, og Niels kan derfor ikke n? at fange Steens Catcher som scorer til 2-2. Kampen er nu mere ?ben igen. B?de Niels og Steen scorer planm?ssigt p? deres n?ste drives og kampen ender 3-3.</p><p style="text-align: left;"><br></p><p style="text-align: left;">OVERTIME!!</p><p style="text-align: left;">Niels starter drive, og scorer til 4-3 uden st?rre besv?r.Steen lykkedes ikke at score i sit drive og Niels f?rer s?ledes 4-3 ved halvleg i overtime(OT er kun 2x4 ture). Steen scorer s? sit drive til 4-4 i 2. halvleg. Niels fejler s? et kast p? 2+ med RR som Steen hurtigt fanger og Steen scorer til 5-4 i sidste tur i overtime og g?r derved i finalen.</p><p style="text-align: left;"><br></p><p style="text-align: left;">Kampen var hele vejen igennem meget sp?ndende, og det var en super t?t kamp. Nerverne var udenp? t?jet, og det var virkelig de sm? marginaler som afgjorde kampen.<br></p><p style="text-align: left;"><br mce_bogus="1"></p>', 1331, 1210, 11, 2240000, 1910000),
