(1394, NULL, 27, NULL, 72, NULL, 74000, 0, -1, 1, 0, 120, 20, 563, 584, '2012-08-03 22:30:24', '2012-08-03 00:00:00', '2012-08-04 10:02:29', 2, 1, '<p>1. halveg: WD starter i angreb, men mister hurtigt bolden da DC Strib ball Blitzer kommer snupper og en flok elvere laver nogle gode dodges, der skaber et sikkert cage. Situationen bliver dog hurtigt vendt da WD snupper bolden igen og scorer til 1-0 i tur 7. Det giver DC to ture til at score og den chance bliver udnyttet og 1. halveg ender 1-1.<br><br>2. halveg. DC starter deres angreb rigtig solidt. DC nyindk?bte assassin sender hurtigt et par n?glespillere i boksen og med et overtal p? 11-7 ser det ud til at DC kan fuld kontrol over situationen. Dette ?ndrer sig hurtigt da WD blitzere begynder at sende elvere ud meget hurtigt og inden l?nge ligger bolden p? jorden og begge hold har 7 spiller p? banen, der p? trods af store anstrengelser ikke form?r at flytte den. &nbsp;<br><br>OT. DC vinder kick-off og med 11 spillere p? banen mod WD 9 ser nemt ud, men DC v?lger at l?gge ud med at rulle et dobbeltskull og er tvunget til at bruge set eneste RR. Herefter f?lger 3 meget hektiske ture og det ender med at DC afg?r kampen med en smuk TD, der kr?vede b?de pick-up i en tackle zone og GFI over m?lstregen.<br><br>Alt i alt var den en meget sp?ndende kamp, hvor det var marginalerne der afgjorde udfaldet. <br></p>', 1301, 1232, 11, 1640000, 1440000),
