(88, 'Knights of the round table(R.I.P.)', 150, 'Human', 5, 5, 1, 1, 1, -930000, 'human.png', 50000, 1000000, 0, 2, 370000, '<p>Dette er udelukkende en turnerings hold har dog spillet 6 rating kampe resten har v&aelig;ret i beach bowl og fall bowl.</p>\r\n<p>Dette er et hold uden de vilde dobbelt stigninger s&aring; best&aring;r prim&aelig;rt af standard stigninger og en enkelt AG stigning p&aring; en atypisk spiller men fungere nu meget godt.</p>\r\n<p>Og ridderne af det runde bord er jo selvf&oslash;lgelig leder af den altid modige Thrower Sir Pendragon og leder ridderne ind i gode kamp med en del boldspil i forhold til at dette er et AG 3 hold.</p>', 1190000),
(104, 'The Good Angels', 130, 'Wood Elf', 3, 1, 1, 1, 1, -2370000, 'woodelf.png', 50000, 1000000, 0, 0, 230000, '<p align="center">How many times <br> does she cradle <br> their shattered bodies <br> in aching arms? <br> How many times <br> does she suffer their pain? <br> We die only once. <br> How many times <br> ...does she die? <br> <br> BY: JOHN KENT <br> <br> <br> These angels are sent from above to put sanity <br> back in the game of bloodbowl.. They will not give <br> in until their task is complete. The only way to <br> reach their goal is to dominate every game, until<br> they are the best team there is.</p>\r\n<p align="center">these are The Good Angels</p>\r\n<p align="left">The team has reached following:<br></p><p align="left">- FallBowl 2008 Champions.</p><p align="left">- TRC 2008 Quarterfinal.</p><p align="left">- FallBowl 2009 Champions.</p><p align="left">- TRC 2009 Runner up.</p>', 2020000),
