(348, 'New England Lycans', 197, 'Necromantic', 4, 0, 0, 0, 0, -940000, 'necromantic.png', 70000, 1000000, 0, 0, 280000, '<p><b><span mce_style="font-size: medium;" style="font-size: medium;">Captains Log:</span></b><img src="components/com_bloodbowl/p_icons/nwerewolf1an.gif" mce_src="components/com_bloodbowl/p_icons/nwerewolf1an.gif" alt="player avatar" width="21" height="20"></p><p><i>November 23 2864</i></p><p>Rico Rico are Player of the week!</p><p>And it is <span id="result_box"><span style="background-color: rgb(255, 255, 255);" mce_style="background-color: #ffffff;" title="parringss?son">mating season for Werewolves so please beware.</span></span></p><p><span id="result_box"><span style="background-color: rgb(255, 255, 255);" mce_style="background-color: #ffffff;" title="parringss?son"><i>November 24 2864</i></span></span></p><p><span id="result_box"><span style="background-color: rgb(255, 255, 255);" mce_style="background-color: #ffffff;" title="parringss?son">William is now an </span></span>emerging star (lets hope he will survive the playoffs, if we make it there)</p><p>A new elf zombie joined the team today, and "snapped" the mvp.&nbsp;</p><p><i>November 30 2864</i></p><p>Rico Rico is our top treeman blocker.</p><p>Bob "banzai" cant deal with woodelves.</p><p>It looks like woodelves are the nemesis of this team, junior and "The Rock" has to work harder when we are playing elf races.</p><p>The ship is off course, but it will hopefully find its way back.</p><p><i>January&nbsp; 04 2865</i></p><p>Another woodelf team has defeated us. nothing more to say<i> </i>until we (hoppefully) win again.</p><p><i>May 04 2866</i></p><p>Its Time to rise and shine again, so we picked yet another slow orc team and defeated the with a 3-1.</p><p>Rico Rico is the favorite Zombie of the team, I praise the day he was raised from that cold norse gaveyard to the north, it was worth the trip.<br></p><p>So as the Captain (Necromancer) of this team, all bones?n?brains at "The 3 legged Horse" tavern are on me tonite</p><p><i>may 26 2866</i></p><p>Lucien is currently being punished at the kennel, for making so useless blocks at the game vs some goats who defeated us in a very hard brawl.</p><p>William is just slightly better when shapeshifted.</p><p>Junior has collected yet another mvp, thoug he has a weak arm, maybe we should find a new arm at the graveyard.</p><p>Jack The Crowe showed off, whit a serious injury vs Fido the Liberator Goat </p><p><i>May 31 2866</i></p><p>"Jack is back!!!!" what can i say, two casualties and one 1 mvp, he is truly man of the match.</p><p>Rico Rico... keeps on fighting. you are "The Zombie" liltle dude.</p><p>Lucien was held up at the kennel, but got much to learn from William who also made a couple of casualties today.</p><p>The two Ghouls did their job to perfection today.</p><p><i>June 12 2866</i></p><p>Rico Rico recived a new kicking boot today, as a small token for once more getting the MVP.</p><p>Lucien has learned hes lesson at the kennel, and had a big comeback today, one big pile of bones is coming hes way!</p><p>Junior took a big at the collarbone, but recovered quickly, after 10 mins. in the dugout.</p><p>At the the end of the match Upham collected hes first kill, grats on that.</p><p><i>June 16 2866</i></p><p>nothing more to say other then, a new offensive play style is under development.<br></p><p><br></p><p><br></p><p><br></p><p><span id="result_box"><span style="background-color: rgb(255, 255, 255);" mce_style="background-color: #ffffff;" title="parringss?son"><br></span></span></p>', 1900000),
