INSERT INTO `gd8h_bb_tourneys` (`tour_id`, `name`, `type`, `created`, `finished`, `admins`, `teams`, `other_tour`, `rules`, `news`, `newsdate`) VALUES
(1, 'TRC Blood bowl league 2008', 'rating', '2008-02-03', '2008-12-31', '65,63', '27,25,90,70,43,106,67,41,37,42,35,128,131,102,61,88,118,87,97,38,120,149,100,152,39,84,101,49,32,69,83,85,50,34,53,40,55,104,115,127,108', '4,5,6,7,8', '<div>\r\n<p>Der spilles efter reglerne beskrevet <a href="../index.php?option=com_content&amp;task=view&amp;id=59&amp;Itemid=55">her</a>.</p>\r\n<p>?</p>\r\n<p>Ang?ende play-offs: 1/4 af play-off pladserne vil blive tildelt som wild-cards. Man kan uanset sin rating kvalificere sig ved at have den h?jeste win % (i forhold til dem der ikke er med i play-off). Det kr?ver kun et minimum p? 5 kampe.</p>\r\n<p>Der vil sandsynligvis blive 8 playoff pladser ialt og dermed 2 wild-cards. Det foruds?tter vi n?r op p? 12 coaches. Ellers reduceres antallet til 4 pladser inklusive 1 wild-card plads.</p>\r\n</div>\r\n<p>?</p>', '', '0000-00-00'),
(15, 'League of Extraordinary G. 2009 playoff', 'playoff', '2009-11-10', '2009-12-10', '63,95,130,65', '', '', '', '', '0000-00-00'),
(16, 'Weekendturnering 5-12-09', 'playoff', '2009-12-05', '2009-12-08', '65', '', '', '', '', '0000-00-00'),
(17, 'TRC BB league 2009 playoff', 'playoff', '2010-01-01', '2010-01-31', '65,63', '', '', '<p><br></p>', '<p>TRC BB League 1/4 finaler:</p>\r\n<p>Kamp 1 mod 2: Steen vs Christian<br> Kamp 3 mod 4: Reno vs Lasse<br> Kamp 5 mod 6: Marc vs Lars<br> Kamp 7 mod 8: Keld vs Peter</p>\r\n<p>Det valgte hold skal erkl?res inden kampstart hvorefter kampen kan oprettes</p><p>semi finaler:</p><p>Vinder 1/2 mod vinder 3/4</p><p>Vinder 5/6 mod vinder 7/8<br></p>', '2010-01-01'),
(6, 'Beach Bowl 2008 Playoff', 'playoff', '2008-06-02', '2008-08-01', '63,95,130,65', '', '', '', '<p>Finalen i Beach Bowl 2008 st&aring;r mellem</p>\r\n<p>Kethavin Huruil (Steen) og Marienbrug Sovereigns (Marc)</p>', '2008-07-09'),
(7, 'Fall bowl 2008', 'round robin', '2008-08-29', '2008-11-22', '63,95,130,65', '70,35,88,97,120,125,53,104,108', '', '<p>Denne gang spiller vi puljespil fra 1. september - 30. november. Playoff vil v&aelig;re i december, s&aring; vi ikke kommer i konflikt med ratingturnerigens s&aelig;sonafslutning i januar! Derfor beder vi venligst alle om at komme i gang med deres kampe tidligt s&aring; man ikke st&aring;r med 3 julefrokoster i november og ikke kan n&aring; at blive f&aelig;rdig med sine kampe. N&aring;r man ikke at f&aring; spillet sine kampe, vil de bortfalde. Dog kan man blive taberd&oslash;mt hvis det har indflydelse for en spiller som m&aring;ske kan n&aring; i playoff. Vi h&aring;ber ikke den situation bliver aktuel, da der er rigtig godt gang i BloodBowl i klubben for tiden.<br />\r\n<br />\r\nVi spiller i en stor pulje, hvor man m&oslash;der alle &eacute;n gang. der gives 3 point for en sejr, og 1 point for en uafgjort.<br />\r\nI playoff bliver det nummer 1 mod nummer 4 og nummer 2 mod nummer 3. Vi ved at folk er vandt til at nummer 1 selv v&aelig;lger sin modstander, men bare &aelig;rgeligt SonnyBoy. <img style="border: 0px none ; vertical-align: middle;" alt="" src="../../../../components/com_fireboard/template/default/images/danish/emoticons/smile.png" /> <br />\r\nVed pointlighed er det denne gang m&aring;lscoren som er tiebreaker til playoffpladserne, og derefter er det indbyrdes opg&oslash;r.<br />\r\n<br />\r\nDet skal lige understeges at det naturligvis ikke er tilladt at spille ratingkampe med sit hold f&oslash;r det eventuelt er sl&aring;et ud af turneringen. Holdene bliver ikke &quot;l&aring;st&quot; som s&aring;dan, men husk lige dette, hvis man f&oslash;ler lyst til at spille almindelige ratingkampe ved siden af.<br />\r\n<br />\r\nPelle deltager ikke i denne turnering, fordi han ikke f&oslash;ler tiden er til det, s&aring; han vil v&aelig;re sidste stemme i situationer som kan involvere Steen, ellers er begge de bestemmende.<br />\r\nPr&aelig;mier bliver oplyst i l&oslash;bet af turneringens f&oslash;rste uge her p&aring; tr&aring;den.<br />\r\n<br />\r\nM&aring; Nuffle v&aelig;re h&aring;rd og lige uretf&aelig;rdig overfor os alle..<br />\r\n<br />\r\nSteen.</p>', '<p>S&aring; er vi klar til semifinalerne i Fall Bowl.</p>\r\n<p>Kampene er:</p>\r\n<p>Reno''s dv&aelig;rge mod Keld''s Undead</p>\r\n<p>og</p>\r\n<p>Lasse''s human mod Steen''s Wood elves</p>', '2008-11-22'),
(4, 'Beach Bowl 2008 A', 'round robin x2', '2008-04-01', '2008-06-14', '63,95,130,65', '84,87,91,70', '', '', '<p>Marienburg Sovereigns og Malekiths Grim Rependers g&aring;r videre til playoff</p>', '2008-06-14'),
(5, 'Beach Bowl 2008 B', 'round robin x2', '2008-03-31', '2008-06-02', '63,95,130,65', '32,42,55,88', '', '', '<p>Steen og Keld er videre til Playoff.</p>', '2008-06-01'),
(8, 'Fall Bowl 2008 Playoff', 'playoff', '2008-11-15', '2008-12-05', '63,95,130,65', '', '', '', '<p>Steen vandt finalen med 4-1. Tillykke!</p>', '2008-12-06'),
(9, 'TRC BB league 2008 playoff', 'playoff', '2009-01-01', '2009-01-31', '65,63', '', '', '', '<p>Tillykke til Niels Strunge!</p>\r\n<p>Nu Klubmester i Blood Bowl 2008 ved at besejre Keld i finalen med 4-1</p>', '2009-01-23'),
(10, 'TRC Blood Bowl league 2009', 'rating', '2009-02-01', '2009-12-31', '65,63', '223,27,25,164,394,411,265,250,252,340,348,358,374,378,189,190,308,70,43,380,412,237,255,253,222,401,366,303,42,154,35,131,342,400,371,346,143,341,325,320,391,319,318,353,168,169,61,148,349,266,322,362,352,118,227,361,207,185,158,217,87,395,97,200,38,179,120,196,202,204,167,181,160,279,231,402,32,397,201,314,69,305,210,182,214,211,345,386,335,216,53,344,334,40,269,55,215,104,309,381,139,398,209,277,285,163,108,383', '11,12,13,14,15,16', '<p>Der spilles efter reglerne beskrevet <a href="/joomla/../index.php?option=com_content&amp;task=view&amp;id=59&amp;Itemid=55" mce_href="/joomla/../index.php?option=com_content&amp;task=view&amp;id=59&amp;Itemid=55">her</a>. Det er i v?sentlighed de samme som i 2008.</p>', '<p>Der er nu ?bnet op s? man kan have s? mange hold som man vil, inden for rimelighedens gr?nser. Keld og jeg vurderer hvad der er rimeligt. Vi vil vurdere antallet af aktive hold samt hvorn?r de er oprettet og hvor mange kampe de har spillet.</p>', '2009-12-21'),
(11, 'Beach Bowl 2009 A', 'round robin x2', '2009-03-01', '2009-06-01', '63,95,130,65', '189,154,202,160,201,163', '', '', '<p>S&aring; blev Beach Bowl 2009 sparket i gang 1.Marts. Keld var t&aelig;t p&aring; at l&oslash;be med dungeon bowl, men det skulle ikke v&aelig;re. Held og lykke til alle!</p>', '2009-03-02'),
(12, 'Beach Bowl 2009 B', 'round robin x2', '2009-03-01', '2009-06-01', '63,95,130,65', '25,169,185,210,216,165', '', '', '', '0000-00-00'),
(13, 'Beach Bowl 2009 Playoff', 'playoff', '2009-06-05', '2009-07-05', '63,95,130,65', '', '', '', '<p>Det lykkedes Keld i fjerde playoff at hive finalesejren hjem. Godt hjulpet af en halfling chef! og elverspil som selv elverne ikke kunne hamle op med.</p>', '2009-06-24'),
(14, 'League of Extraordinary G. 2009', 'round robin', '2009-08-28', '2009-11-30', '63,95,130,65', '43,318,181,305,211,53,334,104', '', '', '', '0000-00-00'),
(18, 'TRC Blood Bowl league 2010', 'rating', '2010-02-07', '2010-12-24', '65,63', '459,463,411,489,430,414,530,348,440,442,479,358,472,374,501,444,189,308,439,416,448,488,495,425,470,401,499,476,366,461,498,154,35,460,423,131,400,528,318,415,148,413,418,492,322,458,362,437,462,431,158,217,449,87,395,447,465,181,474,496,201,314,436,454,426,305,182,481,424,211,345,429,386,335,512,53,421,483,344,334,120,202,471,428,441,531,497,215,104,427,209,277,285,163', '19,20,21', '<p><br mce_bogus="1"></p>', '<p>S? starter en ny s?son 7 februar. Du kan overf?re 2 hold fra sidste ?r samt tilmelde alle de nye hold du orker.</p><p>Send besked til Keld eller Andr? for at f? ordnet en tilmelding<br mce_bogus="1"></p>', '2010-10-13'),
