(22, 'TRC BB league 2010 Playoff', 'playoff', '2010-12-24', '2011-01-31', '65,63', '', '', '<p><br></p>', '<p>Kvartfinalerne bliver :<br> <br> 1. Peter mod<strike> vinder af Pelle</strike>-Niels - Peter gik videre<br> 2. Steen mod <strike>vinder af</strike> Keld<strike>-Kasper R </strike>- Steen gik videre<br> 3. Reno mod <strike>vinder af Lasse</strike>-Mads - Mads g?r videre uden kamp<br> 4. Christian mod <strike>vinder af RasmusKasper O</strike>-Dominik - Christian gik videre<br> <br> Semifinalerne bliver:<br> <br> Peter mod Mads - Peter er klar til finalen<br>Steen mod Christian - Steen er klar til finalen</p><p>Finale:</p><p>Peter mod Steen<br></p>', '2011-01-25'),
(23, 'TRC BB League 2011', 'rating', '2011-02-06', '2011-12-24', '65,63', '543,549,559,472,501,537,524,425,470,516,555,461,42,498,154,35,423,415,148,540,413,266,492,322,118,490,361,207,185,431,158,217,534,539,496,553,554,533,201,314,436,550,454,426,544,210,182,305,214,86,522,40,428,441,531,497,542,55,215,104,427,309,209,277,285,163', '', '<P><BR mce_bogus="1"></P>', '<P>S? er den nye BB s?son skudt igang!</P>\r\n<P>Du kan nu pensionere og reaktivere hold. De pensionerede hold vises med R.I.P. i enden under "Mine Hold". Hvis du pensionerer et hold der ikke har spillet en kamp slettes det helt.<BR></P>', '2011-12-19'),
(24, 'TRC BB league 2011 Playoff', 'playoff', '2011-12-27', '2012-01-31', '63,65,150,72,130,100', '', '', '<p><br mce_bogus="1"></p>', '<p>Playoff for 2011 turneringen er i gang!<br mce_bogus="1"></p>', '2011-12-27'),
(25, 'TRC BB league 2012', 'rating', '2012-01-03', '2012-12-24', '65,150,130', '543,661,223,459,463,27,25,572,728,472,501,537,538,582,524,605,222,566,664,555,461,626,667,666,660,597,540,413,492,651,565,598,571,431,158,570,449,87,585,613,577,586,120,202,534,84,573,610,627,496,533,630,201,314,584,637,563,426,210,182,214,609,345,386,558,618,562,441,55,215,104,427,309,209,567,615,285,599,163,663,620', '27,26', '<p><br mce_bogus="1"></p>', '<p>-</p><p>-</p><p>-</p><p>-</p><p>-</p><p>HUSK AT GIVE JERES SKILLS EFTER JERES KAMPE KAN SE DER ER FLERE HOLD UDEN VALGTE NYE SKILLS.</p><p>-</p><p>-</p><p>-</p><p>-</p><p>-</p><p>-</p><p><br mce_bogus="1">&nbsp;</p>', '2013-03-22'),
